(24, 'The Most Vital Minute in the 15 min encounter', 'the-most-vital-minute-in-the-15-min-encounter', '<p>What is the most important minute of your 15 minutes patient encounter?\r\n\r\nAny guesses? In my opinion the most important minute is the time spent outside the door! Why? Here are the reasons……… </p>', '<p>What is the most important minute of your 15 minutes patient encounter?\r\n\r\nAny guesses? In my opinion the most important minute is the time spent outside the door! Why? Here are the reasons………\r\n\r\nYou are first exposed to a clue as to what case is on the other side of the door eg. abdominal pain. Remember you just know that the diagnosis has something to do with abdomen but you are still far from the list of DD''s you have to come up with. Say you walk in and the patient points to the epigastric region,…..then your mind should go racing after Acute peptic ulcer disease, GERD, Duodenal ulcer, Acute pancreatitis, etc etc……..while if she sits with her hand on the Rt. Iliac fossa frowning, you probably would switch gears to think of Acute appendicitis, PID, torsion ovarian cyst, Endometriosis, Ileitis etc. Keep your options open ……..dont jump into conclusions until you get a thorough history!\r\n\r\nIt is the time to organize your encounter - If you dont take the time now, you will not be able to coherently handle "the show" inside the room. Go over mentally or write down in your blue sheet, what are the possibilities you are thinking of, what systems you will be examining, how will you start the History of present illness, what DD''s are you ruling out and recollect the name of the patient ……….before you put on that beautiful smile of yours and go on in…….KNOCK KNOCK……..it is show time!\r\n\r\nMake a mental note of what systems you are going to examine for eg. if it is LOC (loss of consciousness) you know you must examine CNS and CVS. If you barge in through the door without spending those vital seconds letting your brain pause, think and proceed – you are likely to end up just doing CNS. What are the likely chances that you would be thinking of examing CVS also when your brain is rushing through the History of Present illness, or trying to get the difficult patient to talk or console a crying patient…or get that long CNS history and exam done………let alone thinking about the clock ticking !\r\n\r\nMake a list of DD''s – Hey! it is just common sense to do that before you enter ……..you can always add more as you get more information from the patient. But without even having a couple of DD''s in mind, how are you going to rule out or rule in the diagnosis for this patient while you take history of present illness.\r\n\r\nDont forget your mnemonics - "How can I help you ? " ………Doc I have severe abdominal pain"…..uh…..uh…..hmmm………ahhhaaaaa…….Oh yes ………….When did it start ? …………Cut all the fumbling and mumbling ……..make the flow smooth by writing down your OPDFSC and PAMHUGS FOSS, WADES , FTLW, LIQORAAA…….The first few sentences can set the stage for the entire encounter. For the SP, it is a time (during the intial 10 sentences or so) to decide "Am I going to have a hard time understanding this doctor?" ……… SO, bottom line ………..Make a good impression in the initial greeting and if you have your mnemonics written……..you are well on your way for a smooth encounter! </p>', '', 3, 7, 3, 1, '2017-12-15 16:27:00', '0000-00-00 00:00:00'),
(25, 'Should I Sit or Stand during the encounter?', 'should-i-sit-or-stand-during-the-encounter', '<p>This is a common question I get asked by my students. Well, its really up to you……..if it is an emergency you want to be standing while taking history but otherwise, in my opinion, I think sitting during the encounter is a better option… Here are the reasons…… Please see if it makes sense to you personally …... </p>', '<p>This is a common question I get asked by my students. Well, its really up to you……..if it is an emergency you want to be standing while taking history but otherwise, in my opinion, I think sitting during the encounter is a better option… Here are the reasons…… Please see if it makes sense to you personally …...\r\n\r\n1. It is a long exam….the fatigue factor and the tension/stress of the exam will take its toll on you (at least during the last stretch of the exam). When you sit down you are a little more relaxed (creates a rapport as patient feels more at ease that you are not rushing through), easy on your feet (not giving orthostatic hypotension a chance!) and also, you can sit more professionally : sitting tall, shoulders held back, maybe criss-cross your leg if you are comfortable that way.\r\n\r\n2. Sitting helps you to hold your clip pad better as you can rest it on your thighs. For those of you who can''t read their own handwriting (most of the time)…...support to the clip pad and sitting posture can make a world of a difference!\r\n\r\n3. The drape is folded and kept on the seat. Now, you''re not going to sit on it before you drape the patient, right?\r\n\r\n• I suggest that you sit about an arms-length away from the patient (of course asking his/her permission before you sit down).\r\n• Maintain direct eye contact at all times except briefly to scribble on your blue sheet. Remember that the Patient (SP) is more important than your clip board!\r\n• Last but not the least ………DON''T GET TOO COZY SITTING…….it shouldn''t slow down your speed……..All you got is 15 minutes and the CLOCK is ticking whether you are sitting or standing !!!! </p>', '', 3, 7, 2, 1, '2017-12-15 16:36:42', '0000-00-00 00:00:00'),
(26, 'Pocket Questions – what are they?', 'pocket-questions-what-are-they', '<p>I know we are all expected to enter the room, greet the SP and carry out a smooth co- ordinated encounter. Wouldn''t we all like to be fluent, coherent, well modulated, asking the next question without missing a beat (though our heart is skipping beats),</p>', '<p>I know we are all expected to enter the room, greet the SP and carry out a smooth co- ordinated encounter. Wouldn''t we all like to be fluent, coherent, well modulated, asking the next question without missing a beat (though our heart is skipping beats), smiling (though tensed) and pretend we have it all under control ………until it comes to that "POINT" ……….YES ……..POINT BLANK……..where you are just blank…….What do I ask next ? What case is this I am dealing with? Did I already ask this? Gosh …God help me…..……\r\n\r\nNow here''s where you use what I call "the pocket" questions.\r\n\r\n• Do you have any fever?\r\n• Any headache?\r\n• Any rash?\r\n• Do you feel cold when others don''t?\r\n• Has there been any changes in your weight recently?\r\n• How is your apetite?\r\n• Do you exercise ?\r\nAll these questions can be asked for any case in the exam (any abdominal, chest, cns case). You wont sound inappropriate or obscure! So instead of stammering, stuttering..(uh……..ah……umm…) and getting further worked up……….Just HAVE THEM IN YOUR POCKET. They can come in handy!\r\n\r\nP.S. Hopefully you are again back on track with your line of questioning, ruling in or out the DD''s. Cheer up! </p>', '', 3, 7, 0, 1, '2017-12-15 16:39:10', '0000-00-00 00:00:00'),
(27, 'Doorway info – should I write it down?', 'doorway-info-should-i-write-it-down', '<p>Do I have to copy everything? Not all, but some essentials. Let''s see what they are ……Say you glanced at the doorway information saying " A 60 year old male Sang Lee comes to ER with loss of consciousness. BP 150/80 mm Hg , PR – 80/min, RR 14/min T 99.8 F ".</p>', '<p>Do I have to copy everything? Not all, but some essentials. Let''s see what they are ……Say you glanced at the doorway information saying " A 60 year old male Sang Lee comes to ER with loss of consciousness. BP 150/80 mm Hg , PR – 80/min, RR 14/min T 99.8 F ".\r\n\r\nRemember to remember the patients name before your hand goes to knock on the door. So it is a good idea to write the name down to use it then and also during the encounter.\r\n\r\nAge and sex ?– of course …..if you are thinking of premature menopause in a case of amenorrhea half way through history and happen to check her age on your blue sheet and find it to be 66 years, you probably will revise your diagnosis to a "definitely" menopause.\r\n\r\nAlso say in the above case of Sang Lee, say the man gives a positive history of attacks of dizziness ….your mind goes " was he hypertensive ….what did I read outside? ..150 over…..over…???…" -so if the vitals are written on the blue sheet, you just have to glance down at your clip board!\r\n\r\nAlso, when you come out after the encounter, if u had already written them before you entered the room, you just have to transfer it to the patient notes while typing! Bottom line……..please write down name, age, sex, vitals, chief complaints on your blue sheet before entering. Helps??? ……..I think so….</p>', '', 3, 4, 2, 1, '2017-12-15 16:48:02', '0000-00-00 00:00:00'),
(28, '10 kick starters CS robot!', '10-kick-starters-cs-robot', '<p>Oh yes!…….you are a Robot at "certain times" of the patient encounter. Some things are to be done routinely for every case. For example the entry and introductory part (except for changing the last name of the patient), the PAMHUGS FOSS (the questions you ask are the same, the answers may be different from patient to patient)</p>', '<p>Oh yes!…….you are a Robot at "certain times" of the patient encounter. Some things are to be done routinely for every case. For example the entry and introductory part (except for changing the last name of the patient), the PAMHUGS FOSS (the questions you ask are the same, the answers may be different from patient to patient). Therefore, from an examinee''s perspective you have to be so fluent and proficient in these sections that it should flow as if it were your second nature. No awkwardness or fumbling in these sections of the patient encounter. So, let''s find out how to go about the initial introductory sentences/procedures to impress the SP. Shall we?\r\n\r\nThere are 10 things to be done in order …..and each of them gets graded!\r\n\r\n10 KICK STARTERS FOR THE CS ROBOT: You may want to remember it 2 at a time.\r\nBEFORE ANYTHING–TAKE A DEEP BREATH–dont undermine the value of its relaxing power!\r\n\r\n1. KNOCK KNOCK (Recall patient''s last name before knocking) —-\r\n2) Enter SMILING\r\n3) Mz/Mr……… –\r\n4) I am Dr………… (first patient name then your name)physician at this hospital. Nice to meet you.\r\n5). Shake hands and\r\n6) Eye contact with patient (3,4,5 &6 are done together)\r\n7) When you hear the Chief complaints (after you have asked How can I help you)\r\n8) I am so sorry to hear that (empathy!)\r\n9) DRAPE (as you say "Can I make you more comfortable")\r\n10) SIT DOWN on the Stool ("Do you mind if I sit down and take some notes")\r\n\r\nAll 10 come with practice – in reality in the exam you hardly remember to do these – it becomes natural while your mind is racing on the questions for history of present illness. Without even thinking, after knocking you should realize you are sitting – you know what I mean, right?\r\n\r\nP.S. Remember the patient is forming his first opinion about the new doctor who just entered in the room in these initial few seconds………we want him/her to be impressed, dont we? Practice , practice, practice…… till these 10 kickstarters are your very own !</p>', '', 3, 7, 1, 1, '2017-12-15 16:50:15', '0000-00-00 00:00:00'),
(29, 'New Patient Note (2012)', 'new-patient-note-2012', '<p>In mid 2012, the pattern of the patient note writing for the USMLE Step 2 CS exam changed.</p>', '<p>In mid 2012, the pattern of the patient note writing for the USMLE Step 2 CS exam changed. \r\nThough the general theme and subheadings remain the same, the new format is challenging to the examinee because he/she has to pay attention to details in history and P/E. In the old system, you just had to enlist your possible diagnosis for the case with no explanation as to why you picked the DD. For example if it is a case of chest pain, you could just rattle away with Angina, MI, Costochondritis, Rib Fracture, Pleurisy but now you got to lay it down-Why you think it is MI? Why you think it is Rib fracture?\r\n\r\nChest pain on exertion, associated sweating, location on the precordial region probably radiating to left arm would probably be the basis why you picked Angina/MI. I think the CIS component gets tested here as well because ‘listening effort’ will play a big role in getting to the basis of your diagnosis. If you are focused on just asking questions and not listening and recording the information mentally, you may find it difficult to list the reasons for your DD. The Data Gathering component is also important. What if you don’t ask for chest trauma during the encounter and list Rib Fracture as a DD in your patient notes for Chest Pain?\r\n\r\nBottomline, it is challenging isn’t it? But that’s what we go to do in everyday practice as well. Right? Hence it is just a better system to evaluate you if you are good at what you call yourself to be – a doctor! That’s what your patient wants from you as a doctor as well – “to LISTEN “. So be a good one!\r\n\r\nP.S. In Target’s 7 Easy Steps 2 CS , STEP 4 has an interactive Differential Diagnosis module which will help you guide along the thinking process of pinning down the Diagnosis for various symtoms. Don’t miss to check it out!</p>', '', 3, 4, 3, 1, '2017-12-15 16:51:49', '0000-00-00 00:00:00'),
(30, 'How best can you wash your hands?', 'how-best-can-you-wash-your-hands', '<p>I''m pretty sure about what you''re thinking …….. "What? Who cares how good I wash my hands on the exam. I am already running out of time here…it is an awkward silence when my mind is racing as to what system I am going to examine …..the point is that I wash my hands. Right?" Correct…… I hear you ……\r\n</p>', '<p>I''m pretty sure about what you''re thinking …….. "What? Who cares how good I wash my hands on the exam. I am already running out of time here…it is an awkward silence when my mind is racing as to what system I am going to examine …..the point is that I wash my hands. Right?" Correct…… I hear you ……..\r\n\r\nWhat''s on my mind was more like " How best can you use your time and impress the patient while you wash your hands (sorry chewed up the "un-underlined" words in the title- is that even a word, I wonder ? Okay back to topic….)\r\n\r\n1. Excuse yourself while you go to wash your hands\r\n2. Don''t turn your back completely to the patient. Stand diagonally, so you can still glance at them (eye contact) while you wash\r\n3. Keep a conversation going P.S. You don''t want someone just watching your back, do you ? at least NOT the SP, huh?\r\n\r\n"So what do you do Mr/Mz George? Is your job stressful (you just asked the stress Q here and saved time too!) How about at home? Do you exercise ? That is a good stress reliever, as you probably know". (You threw in the exercise Q too ..and….. cut short on the history taking time …Bravo…..Go on now…to your PE.</p>', '', 3, 6, 0, 1, '2017-12-15 16:56:37', '0000-00-00 00:00:00'),
(31, 'USMLE Step 2 CS', 'usmle-step-2-cs', '<p>USMLE Step 2 CS is a very unique exam which requires a unique way of preparation. It is an examination that assesses you as a medical doctor before you get to practice in the United States. USMLE Step 2 CS tests you on 3 components</p>', '<p>USMLE Step 2 CS is a very unique exam which requires a unique way of preparation. It is an examination that assesses you as a medical doctor before you get to practice in the United States. USMLE Step 2 CS tests you on 3 components: ICE (integrated clinical encounter), CIS (Communication interpersonal skills) and SEP ( spoken English proficiency). <p>The &quot;ICE component&quot; encompasses the data gathering and patient note skills. Most of the ICE component gets graded by the physician who corrects your patient note and the physical exam component gets judged by the Standardized patient (SP). The CIS and SEP part are entirely judged by the SPs. USMLE Step 2 CS pass requires you to pass all three components. Even if you fail in one component you still fail the USMLE Step 2 CS exam! The USMLE Step 2 CS exam appears to be an easy exam especially after all the efforts you have taken for the USMLE step 1 and USMLE step 2 CK exam. So most students take it for granted and just glance at a few books /forums/ask their seniors how to go about it before they take this expensive exam. Unfortunately those resources alone are not sufficient.</p>\r\n\r\n<p>There are nuances to the USMLE Step 2 CS exam that are overlooked by many students until they have taken it several times. The examinees then search for reasons why they failed the exam because the result comes as a shock to them though they asked all the questions and recall being nice to their patients during the exam! Target USMLE has created a very comprehensive, thorough and well thought out game plan for cracking the step 2 cs the first time in the form of 7 Easy steps 2 cs. It is a self study program from home with a 24 hour access for 30 days. Please don&#39;t start practicing cases before you know you are doing it the right way. We have had many students who failed step 2 cs pass with this program even after their 3rd or 4th attempt using other resources. It is the first of its kind - an online teaching program with short video lectures and demos that covers A-Z of the USMLE Step 2 CS exam at very nominal prices (1/10th of live coaching rates). You get to watch these videos at your own free time! By going through our step by step program for USMLE Step 2 CS you are all set to practice with your study partners the right way. Step 2 cs Do it once. Do it right!</p>\r\n</p>', '1.JPG', 3, 5, 7, 1, '2017-12-15 17:04:31', '0000-00-00 00:00:00'),
(32, 'First Aid usmle step 2 CS', 'first-aid-usmle-step-2-cs-1', '<p>As one of the co-authors of First Aid Usmle step 2 cs book (3rd edition, 2009) I know that a great effort has been put together by the first aid usmle step 2 cs team in the form of a book to meet the needs of the student for the usmle step 2 cs exam.</p>', '<p>As one of the co-authors of First Aid Usmle step 2 cs book (3rd edition, 2009) I know that a great effort has been put together by the first aid usmle step 2 cs team in the form of a book to meet the needs of the student for the usmle step 2 cs exam. It has been the sole source of study material for many students over the years.</p>\r\n\r\n<p>In 2012, when the pattern of the exam changed especially in the step 2 cs patient note format, the change was not updated immediately in the 4th edition. The 5th edition released in 2014 is the current edition as of now (2016 Jan). It has updated patient notes under each long case in the format as expected in the USMLE step 2 cs exam. Most students who have taken the exam express in multiple forums that first aid usmle step 2 cs book covers all types of cases that come in the real exam even though it may not be exactly be the same presentation.</p>\r\n\r\n<p>However, the general consensus among students is that the first aid usmle step 2 cs book does not train the students as an individual tool to prepare themselves effectively for the ICE component of the step 2 cs exam. There are students who have gone through the book several times but are not still effective in presenting a step 2 cs case. Whether it is a problem at the student&#39;s end need to be factored in as well! Though all the information is presented in this book it does not organize it for you to present it as a logical and fluent step 2 cs exam case presentation after you have read the initial sections. Students still look out for formats to practice a clinical case the step 2 cs way even after reading this book. 44 full length cases given in Section IV of the first aid usmle step 2 CS book is a good tool to practice with your study partners. However how to use all 4 sections of the first aid usmle step 2 cs into a practical and feasible 15 min encounter and a 10 min patient note is entirely upto your personal organizing skills.</p>\r\n\r\n<p>&nbsp;</p>', '2.JPG', 3, 5, 1, 1, '2017-12-15 17:13:11', '0000-00-00 00:00:00'),
(33, 'Step 2 CS Patient Note', 'step-2-cs-patient-note-1', '<p>Step 2 cs patient note has been the one critical factor that has kept many doctors from passing the usmle step 2 cs exam. Ever since the ECFMG changed the format of the USMLE step 2 CS exam in June 2012 many students including USA trained graduates are failing the ICE component of which patient note is one aspect</p>', '<p>Step 2 cs patient note has been the one critical factor that has kept many doctors from passing the usmle step 2 cs exam. Ever since the ECFMG changed the format of the USMLE step 2 CS exam in June 2012 many students including USA trained graduates are failing the ICE component of which patient note is one aspect (Data gathering is the other).</p>\r\n\r\n<p>The main change was in the step 2 cs patient note where the examinee was asked to come up not only with 3 differential diagnosis but to substantiate their diagnosis with history and physical exam findings. This presents a new challenge to the doctors who need to be attentive for these clues during their stressful time bound 15 min encounter. Step 2 cs patient note requires for the doctor to have good typing skills which many of the international medical graduates and doctors are not adept with.</p>\r\n\r\n<p>The step 2 cs patient note is corrected by the physician. There are 2 things that you need to know to write an excellent step 2 cs patient note a) What to type? b) How to type in 10 min time? Both these critical factors are taught in a step by step manner with many tricks and tips in Target USMLE&iuml;&iquest;&frac12;s Online video tutorial program: 7 Easy steps 2 CS.</p>\r\n\r\n<p>Furthermore, to help you achieve your goal of typing step 2 cs patient note in 10 min we have built an interface akin to the real exam where you can practice typing the cases you practice with your cs study partners. You may start off typing step 2 cs patient note in 13 min but eventually with practice you can tune it to under 10 min. Our unique step 2 cs patient note typing interface helps you to time yourself and gives you a warning at the end of 8 min saying you have 2 min left and lets you email a copy to your personal email inbox so that you can send it for correction. Its free! Start practicing step 2 cs patient note in 10 minutes before you actually take the usmle step 2 cs exam.</p>\r\n\r\n<p>&nbsp;</p>', '3.JPG', 3, 4, 2, 1, '2017-12-15 17:16:43', '0000-00-00 00:00:00'),
(34, 'ECFMG step 2 cs', 'ecfmg-step-2-cs-1', '<p>Ecfmg step 2 cs bulletin is published well ahead of time - the previous year for international medical graduates (IMG) to plan your trip to the USA to take this unique exam.</p>', '<p>Ecfmg step 2 cs bulletin is published well ahead of time - the previous year for international medical graduates (IMG) to plan your trip to the USA to take this unique exam. You should plan your exam dates/year according to the current ecfmg step 2 cs bulletin of the year you plan to take the exam.</p>\r\n\r\n<p>ECFMG step 2 cs test centres are in 5 cities: Houston, Philadelphia, Los Angeles, Chicago and Atlanta. These centers are booked several months ahead by doctors across the world and hence you need to plan in advance.</p>\r\n\r\n<p>The current 2015 ecfmg step 2 cs exam fee is 1505 USD for a one year eligibility period. You may reschedule the ecfmg step 2 cs exam any time within the eligibility period but if you have to cancel within a 14 day period you are charged a fee. Ecfmg step 2 cs rescheduling fee is 400 USD if you cancel between 3 - 14 days. If you cancel the ecfmg step 2 cs exam 2 days before your scheduled date you will be charged $625. If you cancel 1 day prior to your ecfmg step 2 exam date or miss your appointment you will be paying 1250 when you reschedule (updated information at www.ecfmg.org)</p>\r\n\r\n<p>Instead of postponing the ecfmg step 2 cs exam due to deficient prep or lack of confidence you might as well invest the rescheduling fee amount in getting yourself trained to face this exam confidently. Taking group classes doesn&iuml;&iquest;&frac12;t give a perspective on how YOU are performing. Moreover choosing a coaching class few days in a row and then appearing for a mock exam at the end of it will be more of a drill than actually getting trained for the real exam.</p>\r\n\r\n<p>Most students who passed agree that it takes time and practice to get the ecfmg step 2 cs exam done with confidence. Learn the right methods from experts who have trained many, imbibe and practice it with cs study partners, time yourself to see if you can do it, get assessed if you are covering all elements of data gathering and patient note. Think logically before you sign up and spend thousands of dollars on live coaching if you are taking the exam very close to your training. It doesn&iuml;&iquest;&frac12;t stop with the coaching fee but flight tickets to the centre, accommodation and food for the duration of the course. ECFMG step 2 cs exam preparation is a process of getting yourself trained to take a focused history and physical exam in a time pressured environment under stressful conditions! Get ready the right way and get it done the first time around!</p>\r\n\r\n<p>&nbsp;</p>', '4.JPG', 3, 7, 0, 1, '2017-12-15 17:19:34', '0000-00-00 00:00:00'),
(35, 'Step 2 CS schedule', 'step-2-cs-schedule-1', '<p>Step 2 cs schedule for taking the step 2 cs exam is available online at www.ecfmg.org. It is important that you plan your exam date precisely as per the step 2 cs schedule It is especially important for International medical graduates</p>', '<p>Step 2 cs schedule for taking the step 2 cs exam is available online at www.ecfmg.org. It is important that you plan your exam date precisely as per the step 2 cs schedule It is especially important for International medical graduates ( IMGs) to take into consideration not just the step 2 cs schedule, but arrange for visa, flight tickets, score reporting dates, probably search for clerkships in hospitals/ universities that they can complete while they are visiting the United States.</p>\r\n\r\n<p>The step 2 cs schedule helps as a guideline for medical graduates and doctors to plan their step 2 cs exam date in such a way that they get their score reports on time to appear for the match. A lot of thought needs to go in while looking at the step 2 cs schedule because the score reporting takes longer than it takes for step 1 or step 2 ck. While everyone wants to pass step 2 cs in the first attempt, some students find themselves missing out on the match because they did not plan on failing the first time!</p>\r\n\r\n<p>The step 2 cs schedule allows examinees to book for their exam date for upto 1 year time frame eligibility in any of the 5 cities that the exam is offered after which the step 2 cs scheduling permit expires. Strategically looking at the step 2 cs schedule, one should plan for a retake of the exam just in case they did not make it the first time. Typically the Step 2 cs schedule shows a testing period over a span of ~ 2 months and a score reporting period of ~3 weeks time. Plan to take the exam based on the score reporting period and give room for a retake, well ahead in time for the application timeline for the match. Most examinees will receive their score report on the first Wednesday of the score reporting period but the test takers who took it in the latter part of the testing period may not get it until later but within the reporting period. So plan well ahead of time!</p>\r\n\r\n<p>&nbsp;</p>', '5.JPG', 3, 7, 0, 1, '2017-12-15 17:24:05', '0000-00-00 00:00:00'),
(36, 'Step 2 CS video tips', 'step-2-cs-video-tips-1', '<p>Action speaks louder than words! As per the old adage seeing some step 2 cs video tips takes your step 2 cs preparation to a newer level than just reading tons and tons of notes and mnemonics. Step 2 cs video tips help you to see what is being said in text books in a practical and presentable manner.</p>', '<p>Action speaks louder than words! As per the old adage seeing some step 2 cs video tips takes your step 2 cs preparation to a newer level than just reading tons and tons of notes and mnemonics. Step 2 cs video tips help you to see what is being said in text books in a practical and presentable manner. Moreover the step 2 cs video tips help you better understand how the acting physician does the manoeuvres in the correct way. Another advantage of the steps 2 cs video tips to see how quickly you can perform those physical exams in just a few minutes by just mimicking what is done in these videos.</p>\r\n\r\n<p>There are a lot of videos out there on the internet but Target USMLE offers step 2 cs video tips which help you to fine tune it to the step 2 cs pattern . It helps you to do a focused physical exam within the time frame allotted amongst other things you have to do in a clinical encounter: history, counselling, transitions etc. We have put together a video tutorial for preparing effectively for the usmle step 2 cs. We know that our step 2 cs video tips will be an active learning process that will aid you during your actual exam.</p>\r\n\r\n<p>Moreover the step 2 cs video tips also gives you cues to be efficient in CIS component of the exam. How to address challenging questions and handle difficult patients are also addressed in our step 2 cs video tips. Most of us are visual learners - so instead of sitting with books it is better to get insights and gain confidence by watching our usmle step 2 cs video tips and demos. There are many of our video samples posted on You Tube to help you pass step 2 cs. Please share them with your step 2 cs study partners and help others pass this exam as well.</p>\r\n\r\n<p>More and more students access step 2 cs videos from our website - video tutorial program and they find them very informative and short so that they can watch it in transit or free time in between work hours (see testimonials). You will also find a study plan for step 2 cs on our website and also some video and audio tips in our free tips page. Be on the lookout for more step 2 cs video tips both on our website www.targetusmle.com and on You tube. Subscribe to our channel. Stay tuned for more cs videos. Good luck!</p>\r\n\r\n<p>&nbsp;</p>', '6.JPG', 3, 7, 0, 1, '2017-12-15 17:26:53', '0000-00-00 00:00:00'),
(37, 'How to Sail Through With The Proper Step 2 CS Preparation', 'how-to-sail-through-with-the-proper-step-2-cs-preparation-1', '<p>Step 2 CS is basically designed to test your ability to perform in a practical environment. Students are tested on written and verbal skills as well as the ability to carry out physical examinations and taking a proper medical history</p>', '<p>Step 2 CS is basically designed to test your ability to perform in a practical environment. Students are tested on written and verbal skills as well as the ability to carry out physical examinations and taking a proper medical history. With adherence to a few strategies during Step 2 CS preparation, a student will be adequately equipped to tackle the test.</p>\r\n\r\n<p>As with any test, the first step is to understand the system and what is specifically required to pass the exam. Usmle Step 2 CS is generally divided into Spoken English Proficiency, Communication and Interpersonal Skills, and Integrated Clinical Encounter. A thorough understanding of what is required marks the first strategy for Step 2 CS preparation.</p>\r\n\r\n<p>The next strategy is to familiarize yourself with helpful resources. One reliable source of reading material is Target Usmle. The website offers Step 2 CS preparation material in the form of video tutorials, online courses, online mock exams, professional exam tips, and even a live CS boot camp. Target Usmle emphasizes on a personalized approach and full support until the examination date. Students can also take on additional resources such as First Aid along with the Target USMLE course. There are also various books out there like Kaplan that contain sample test cases and all vital information that may be useful.</p>\r\n\r\n<p>As we all know, practice makes perfect. During a Step 2 CS preparation, it is crucial for students to practice with as many cases as possible since the exam is focused on precision. Live or online courses offered by Target Usmle should come in handy. These courses offer great support on CIS, SEP and ICE components. Students may also practice with peers who serve as patients. It is important to carry out a full simulation of the exam scenario before taking on the real exam itself. This strategy would entail typing up patient notes, timing yourself, and dressing in the respective roles. Fortunately, Target USMLE has a mock exam that can assess the student&#39;s performance on the real exam. Finally, approach the exam day with confidence and ready to play the role of a doctor.</p>\r\n\r\n<p>&nbsp;</p>', '7.JPG', 3, 7, 3, 1, '2017-12-15 17:31:57', '0000-00-00 00:00:00'),
(38, 'Why Medical Students Fail The STEP 2 CS Exam', 'why-medical-students-fail-the-step-2-cs-exam', '<p>Almost a third of the medical students have failed the STEP 2 CS exam on their first attempt. Fortunately, by knowing how and why students fail can help you avoid the same mistakes. </p>', '<p>Almost a third of the medical students have failed the STEP 2 CS exam on their first attempt. Fortunately, by knowing how and why students fail can help you avoid the same mistakes.\r\n\r\nReasons most students fail the STEP 2 CS exams:\r\n\r\n<p>1) Failed to smile and be well-liked:\r\nOne of the most important things that you should remember is that these are not real patients. They are SP (standardized patients) or as I would call them "fake patients." That means they cannot judge you on your clinical knowledge, but only on your greetings and performance. That is why most people fail the STEP 2 CS exam because they forget to greet the patient with a smile. Students are too obsessed with impressing a fake patient with their clinical knowledge when in fact they should be concentrating on smiling and being presentable and well-liked. It''s also important to show empathy towards your patient. Let them know that you understand their pain. At the end of your interview, your SP will have a checklist in their hands. If they don''t like the way you treat them despite your vast clinical knowledge, you will just end up failing for something as simple as not smiling and being well-liked.</p>\r\n\r\n<p>2) Being Too Nervous\r\nMost students usually get too nervous and forget the important things to ask their SP. Before approaching the step 2 cs exam, it''s important to learn how to overcome anxiety. Number one suggestion of test-taking-anxiety is to practice. Fortunately, step 2 cs exam prep such as Target USMLE provides various strategic methods to help students overcome their anxiety. They also provide mock trial examinations to help students practice their clinical skills. After all, practice makes perfect and can also build confidence.</p>\r\n\r\n<p>3) Bad Pronunciation\r\nIMG students usually have the hardest time passing the STEP 2 CS exam. The step 2 cs exam is geared towards English speaking students. If a student''s pronunciation is hard to understand, they can easily fail the exam. It is highly recommended that IMG students take a step 2 cs prep course like Target USMLE, which can help focus on the necessary skills for passing the STEP 2 CS exam as well as the Spoken-English-Proficiency (SEP).</p>\r\n\r\n<p>4) Not Understanding Which Portion of the Exam is Worth More\r\nThe counseling and the patient notes are worth majority of the points. A lot of times, students get so hung up on the physical examination and interviewing questions that they ran out of time and failed to counsel their patient. If you missed over two counseling sessions, that can easily lead to a fail. As for patient notes, there are certain guidelines that students have to follow to pass. Each section on the patient notes are scored differently. It''s important to know which sections are worth more. Fortunately, step 2 cs exam prep like Target USMLE can provide guidance and techniques on how to create a passing patient note and which areas to focus on to ensure that you get maximum points.</p>\r\n</p>', '8.JPG', 3, 7, 5, 1, '2017-12-15 17:45:27', '0000-00-00 00:00:00'),
(39, 'The Criteria for Passing The STEP 2 CS Exams', 'the-criteria-for-passing-the-step-2-cs-exams', '<p>USMLE Steps 2 cs exam assesses the examinee''s ability to apply their medical knowledge towards a controlled clinical setting.</p>', '<p>USMLE Steps 2 cs exam assesses the examinee''s ability to apply their medical knowledge towards a controlled clinical setting.\r\n\r\n<p>It tests examinees ability to think and act as a physician. They will be greeting, interviewing, physically examining, counseling, and writing patient notes. They will be highly tested on how they gather information, empathize, communicate their outcomes to patients, and perform physical exams. A lot of students feel that the step 2 cs exam is a mystery. Fortunately, it is not, and there are straightforward criteria that are crucial for students in passing the exam.</p>\r\n\r\n<p>1) Excellent communication with SP\r\nIt is highly required to properly greet the patient, wash your hands, put on gloves, and empathize. It is important that IMG students are aware of certain pronunciations and can speak clearly during the step 2 cs exam. SP are given the checklist to grade students based on their interactions. If the sp does not like the student''s performance, they can easily fail the student.,</p>\r\n\r\n<p>2) Thorough Counseling is a Requirement\r\nThis is an important step, and a lot of points are placed on it. Even if the student does not finish the physical examination or the interviewing portion, it is highly recommended that they complete the counseling portion. Completion of the counseling portion in all the cases can guarantee a passing score despite mediocre interview and physical exams.</p>\r\n\r\n<p>3) Excellent Patient Notes\r\nStep 2 cs exam places a lot of emphasis on the patient notes. It is worth a big chunk of the exam. Certain areas on the patient notes are worth more such as Differential diagnosis, lab order, and history taking. It is advisable to complete these in chronological order: 1) differential diagnosis 2) lab orders 3)patient history 4) physical examinations. Keep in mind that the step 2 cs exam understands that there is no such thing as a definite diagnosis. As long as you have evidence to back up your differential diagnosis, then you are good to go.</p>\r\n</p>', '9.JPG', 3, 5, 3, 1, '2017-12-15 17:50:06', '0000-00-00 00:00:00'),
(40, 'What to do If You Found Out You Have Failed The Step 2 CS?', 'what-to-do-if-you-found-out-you-have-failed-the-step-2-cs', '<p>Have you ever had that terrible feeling when you attend an exam being unprepared? Or worse, what happens with your life if you FAIL it? Well, guess what, life goes on. </p>', '<p>Have you ever had that terrible feeling when you attend an exam being unprepared? Or worse, what happens with your life if you FAIL it? Well, guess what, life goes on. The first thing which comes to mind is the heartbreak of your parents, grandfathers, relatives and even some of your neighbors (oh yes, even them!). It gives you doubts about the future, it gets into your head, distracts you from your primary goal and wears into your body and organ systems. It is called a negative stress cycle.\r\n\r\n<p>However, there is a way out. Don''t let be distracted, understand your principal intentions and remember the main reason you are here. An exam failure is always a signal which shows that you have to get yourself together and step up. To fail an exam (especially the one that''s connected with patient healing and saving people''s lives) is always a tough thing to bear, particularly in the field of medicine where every little detail is important. But have you ever wondered what happens if the lawyer forgets the laws? In the worst case scenario, he will lose the case. Or for example what happens if a businessman uses a wrong business strategy? Again, at worse, he will drive his business to bankruptcy. But imagine if a doctor doesn''t have enough knowledge and competence of what exactly must be eliminated during the surgery or how to deal with diseases? In the worst case, a person dies. How about that for a motivation? I mean you literally have a grace to save people, free them up from pain and bring them to life. So let Target USMLE help you do that.</p>\r\n\r\n<p>Target USMLE can help you identify why you have failed and help you fix it. Our online course consists of videos, lectures, a personal medical instructor, and motivational support from our peers. We know how it feels to fail, and we know what needs to be done. Let us be your pillar of support and guidance to destroying the USMLE STEP 2 cs.</p>\r\n\r\n</p>', '10.JPG', 3, 5, 4, 1, '2017-12-15 17:52:43', '0000-00-00 00:00:00'),
(41, 'Nourish During CS Preparation', 'nourish-during-cs-preparation', '<p>Part of your road to residency is passing the Step 2 CS Exam. While part of the preparations for the grueling test includes practice sessions and mock exercises to highlight your clinical skills, you also need to pay attention to what you drink and eat before and on the big day.</p>', '<p>Part of your road to residency is passing the Step 2 CS Exam. While part of the preparations for the grueling test includes practice sessions and mock exercises to highlight your clinical skills, you also need to pay attention to what you drink and eat before and on the big day. You will be surprised at how much your diet is going to affect your overall performance.\r\n\r\n<p>One of the most common pitfalls that people taking the exam encounter is not paying enough attention to what they are eating while prepping up. For a long and grueling exam, endurance is a huge thing. For mental marathons such as the Step 2 CS exam, it is critical. A stressful ordeal like this emphasizes the need for proper nutrition. The following are tips on foods that should be included in your diet while you prepare for exam day.</p>\r\n\r\n<p>Eat foods that are brain-boosters. These are foods that are rich in protein and are known to improve mental alertness- something you need if you are to pass the test. Among the healthy food choices, you should eat include nuts, eggs, blueberries, and yogurt among others.</p>\r\n\r\n<p>If you need sugar boosts, go for fruits. Bananas, strawberries, and oranges are very good choices. Make sure to include vegetables such as raw carrots, spinach, and broccoli in your choices too.</p>\r\n\r\n<p>Drink green tea instead of energy drinks. It is very common for people prepping for an exam to stock up on drinks that are packed with caffeine due to the boost it provides. Not only are they stomach-churning, they can cause one to feel even more fatigued in the process. A healthy option would be green tea. It has high doses of caffeine and since it has antioxidants, it can help you concentrate more.</p>\r\n\r\n<p>Always bear in mind that the right food can keep you energized and alert throughout the exam, especially with the long hours involved. The right dietary choices will ensure that you will perform at your best on test day.</p>\r\n</p>', '11.JPG', 3, 7, 0, 1, '2017-12-15 18:09:07', '0000-00-00 00:00:00'),
(42, 'Clinical Rotation & CS', 'clinical-rotation-cs', '<p>Every aspiring medical practitioner knows how crucial the USMLE Step 2 CS exam is. Still, there are many students that tend to underestimate the many aspects of this exam. You would most certainly want to pass it on your very first attempt. </p>', '<p>Every aspiring medical practitioner knows how crucial the USMLE Step 2 CS exam is. Still, there are many students that tend to underestimate the many aspects of this exam. You would most certainly want to pass it on your very first attempt. Needless to say, proper planning is critical if you are to make it to the finish line.\r\n\r\n<p>Be aware that the exam is graded as either pass or fail. While it does have a high passing rate, this causes a lot of students to take things for granted, which paves the way to leniency. As a result, they end up coming in ill-prepared on the big day.</p>\r\n\r\n<p>Managing your time is a crucial part of getting the passing grade for the exam. You need to learn the practical skills required of you in actual clinical rotations. Brushing up on the things that you need to do when seeing a patient, diagnosing, and making notes about the visit will be critical to passing the exam.</p>\r\n\r\n<p>A good way to manage your time when prepping up for the exam is to first know the format. Familiarize yourself with the do''s and don''ts and the time limits involved while making sure that you showcase your clinical competency. Read a lot so you know how to handle different cases. It cannot be emphasized enough how you need to practice too.</p>\r\n\r\n<p>It would help to take advantage of online resources offered by sites like Target USMLE. Unlike other courses that require you to have to spend time getting to and from an actual classroom, the course is conducted online. This means that you can go through the course from the convenience of your own home. It allows you to learn and practice at your most convenient time.</p>\r\n\r\nRemember that the USMLE Step 2 CS exam is a way for you to showcase how efficient your clinical rotation skills are. With proper practice and effective time management skills, getting that passing rate should be easy.</p>\r\n</p>', '12.JPG', 3, 5, 0, 1, '2017-12-15 18:13:59', '0000-00-00 00:00:00'),
(43, 'Relax Its Just CS!', 'relax-its-just-cs', '<p>When you have a big test around the corner, you might have a lot of emotions running through your head. You''re probably stressing out because you don''t think that you studied enough or took enough time to learn your stuff.</p>', '<p>When you have a big test around the corner, you might have a lot of emotions running through your head. You''re probably stressing out because you don''t think that you studied enough or took enough time to learn your stuff. Or you might be frustrated because you don''t understand everything that''s going to be on your test. Perhaps you''re mad at yourself for deciding to take this test in the first place!\r\n\r\n<p>No matter what you''re thinking, you have got to find ways of how to relax before taking your USMLE Step 2 CS ExamWord. Continue reading to learn the top tips we have for you.<p>\r\n\r\n<p>Take some time away from your study materials\r\n\r\nEven though this might seem as if you''re going against common sense and taking away from your study time, by taking some time away from studying, you are actually going to be helping yourself out. You will be able to give your brain some time to recharge and when you come back to your study materials, you will be much more likely to remember the information.</p>\r\n\r\n<p>Do something that you enjoy for half an hour or an hour\r\n\r\nA lot of the times, we just spend way too much time with our noses inside of our textbooks and study materials. If you take some time away and do something that you thoroughly enjoy, then you''re going to feel a lot more positive and ready to take on the world. Maybe you could take a walk outside in the sunshine or take a nice, warm bath to relax.</p>\r\n\r\n<p>Try some yoga or meditation\r\n\r\nWhen all of those emotions start bubbling up in your body, you should try some yoga or meditation to calm down a bit. These activities have been shown time and time again to help people focus their energies and throw away the frustration and stress bogging them down. When you clear your head with a quick meditation or yoga session in between studying, then you''re going to not only remember more information but make a better score on your test.</p>\r\n</p>', '13.JPG', 3, 7, 2, 1, '2017-12-15 18:18:16', '0000-00-00 00:00:00');
INSERT INTO `blogs` (`id`, `title`, `slug`, `short_description`, `description`, `image`, `posted_by`, `category_id`, `view_count`, `status`, `created`, `modified`) VALUES
(44, 'Why Target for CS?', 'why-target-for-cs', '<p>The Step 2 CS exam of the USMLE is a cause of heartbreak (and bankruptcy!) among thousands of aspiring physicians. "Where did I go wrong?", students ask themselves.</p>', '<p>The Step 2 CS exam of the USMLE is a cause of heartbreak (and bankruptcy!) among thousands of aspiring physicians. "Where did I go wrong?", students ask themselves. "I saved months of salary to take an expensive Step 2 CS live coaching to no avail. I know I did well in the trial. What went wrong?"\r\n\r\n<p>These are questions every student who failed the exam ask themselves. An easy answer is this: they took the wrong preparation course.\r\n\r\nTarget USMLE for Higher Chances of Success\r\n\r\nTarget USMLE was born to address the pervasive need for affordable and highly effective preparation courses for Step 2 CS. Through our online course, we have helped 2nd or 3rd takers pass the exam! We believe that students don''t have to put themselves in debt just to pass the exam. Here is what differentiates the Target USMLE from other courses:\r\n\r\nBeginner-friendly and effective video lectures and demos.\r\n\r\nTarget USMLE breaks down Step 2 CS into 7 Easy Steps. These 7 easy steps are presented through video lectures and demos which you can watch at your pace.\r\n\r\nYou are not obliged to log into a specific time; you can watch everything at your own pace. This makes the course easily accessible and easy to digest.\r\n\r\nThe courses also show you what is actually expected of you in Step 2 CS, thus effectively preparing you for the exam.</p>\r\n\r\n<p>2. Study at your own time - anywhere.\r\n\r\nForget about live coaching that requires you to travel to a different state. Once you buy our course, you can watch it anywhere you are - whether on your couch or in the school cafeteria. You can also avail our one-on-one online coaching.\r\n\r\n10x cheaper than live coaching rates.\r\n\r\nHow much does the Target USMLE cost? Just $50 per step. You don''t have to sell your kidney just to take the course. And what''s even better is that you can buy each step individually. Spend one $50 at a time at your own pace so you won''t have to shell out $3500 if you can''t.\r\n\r\nTarget USMLE is designed to help students pass the exam the first time. Our unique methods are proven effective by hundreds of our students who passed the exam.</p>\r\n</p>', '14.JPG', 3, 5, 0, 1, '2017-12-15 18:23:15', '0000-00-00 00:00:00'),
