(4, 'WORK UPS', 'work-ups', '<section class="workups-section">\r\n<div class="container">\r\n<h1><span>Work ups</span></h1>\r\n\r\n<p>Note : The important tests are highlighted in bold</p>\r\n\r\n<div class="row">\r\n<div class="workups-inner col-md-12 col-sm-12 col-xs-12">&lt;!-- List --&gt;\r\n<div class="workups-list">\r\n<h4><span>Cardiovascular system</span></h4>\r\n\r\n<div class="top">\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>\r\n			<h3>Diagnosis</h3>\r\n			</th>\r\n			<th>\r\n			<h3>Investigations</h3>\r\n			</th>\r\n		</tr>\r\n	</thead>\r\n</table>\r\n</div>\r\n\r\n<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Myocardial Infraction</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>ECG</strong>, Echo, <strong>Cardiac Enzymes</strong>, CBC, ESR, CXR, Electrolytes, Blood typing and cross match, Angiography</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Angina</p>\r\n			</td>\r\n			<td>\r\n			<p>ECG, Echo, Cardiac Enzymes, <strong>Cardiac Stress Test</strong>, Angiography</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Pericarditis</p>\r\n			</td>\r\n			<td>\r\n			<p>ECG, Echo, Cardiac Enzymes, <strong>Pericardiocentesis</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Costochondritis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, CXR</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Aortic Dissection</p>\r\n			</td>\r\n			<td>\r\n			<p>CXR, Echo - <strong>TEE</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Rheumatic Heart Disease</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CRP, ECG, <strong>elevated or rising antistreptolysin O titre/ DNAase</strong>, Echo</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Valvular Heart Disease</p>\r\n			</td>\r\n			<td>\r\n			<p>ECG, CXR, <strong>Echo</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Arrhythmia eg : A Fib</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>ECG</strong>, Echo, Holter monitor</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Heart Failure</p>\r\n			</td>\r\n			<td>\r\n			<p>ECG, <strong>Echo</strong>, CBC, Electrolytes, TFT</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Endocarditis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CRP, <strong>Blood cultures</strong>, ECG, Echo</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Hypertension</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, Lipid profile, Electrolytes, Sr. Creat, BUN</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Varicose Veins</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>Doppler USG</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Deep Vein Thrombosis</p>\r\n			</td>\r\n			<td>\r\n			<p>D - dimer, <strong>Doppler USG</strong>, PT, aPTT, INR, fibrinogen</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Peripheral Artery Disease</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>Ankle Brachial Index</strong>, Doppler ultrasound, Angiography</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Pulmonary Hypertension</p>\r\n			</td>\r\n			<td>\r\n			<p>PFT, ABG, CXR, ECHO, ECG, <strong>Cardiac cath</strong>, V/Q scan</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&lt;!-- List --&gt; &lt;!-- List --&gt;\r\n\r\n<div class="workups-list">\r\n<h4><span>Respiratory System</span></h4>\r\n\r\n<div class="top">\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>\r\n			<h3>Diagnosis</h3>\r\n			</th>\r\n			<th>\r\n			<h3>Investigations</h3>\r\n			</th>\r\n		</tr>\r\n	</thead>\r\n</table>\r\n</div>\r\n\r\n<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Pneumonia</p>\r\n			</td>\r\n			<td>\r\n			<p>ECG, CBC, Pulse Oximetry, Electrolytes, CXR, Sputum gram stain and culture</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Bronchiolitis</p>\r\n			</td>\r\n			<td>\r\n			<p>ECBC, Sputum stain and culture, CXR</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Sinusitis</p>\r\n			</td>\r\n			<td>\r\n			<p>XRay Sinus, CT sinus</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Pulmonary embolism</p>\r\n			</td>\r\n			<td>\r\n			<p>Spiral CT, CXR, D-dimer, CBC, Blood type &amp; cross match, V/Q scan</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Asthma</p>\r\n			</td>\r\n			<td>\r\n			<p>Pulse Oximetry, PFT, DLCO, Spirometry, Methacholine challenge, CXR, Sputum analysis</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>COPD</p>\r\n			</td>\r\n			<td>\r\n			<p>Pulse Oximetry, PFT, Spirometry, CXR</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Bronchiectasis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, Electrolytes, ESR, CXR, CT chest, Sputum analysis, Sputum culture.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Tuberculosis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, Mantoux, CRP, Electrolytes, CXR, Sputum AFB and culture</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Pleural effusion</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CXR,<strong>Thoracocentesis and pleural fluid analysis &amp; cytology</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Sarcoidosis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CXR, CT chest, LFT, PFT, <strong>Endoscopic USG with FNA of mediastinal LN.</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Lung Cancer</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, CXR, Sputum analysis, Bronchoscopy and biopsy</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Obstructive sleep apnea</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, Lipid profile, Polysomnography</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Foreign body aspiration</p>\r\n			</td>\r\n			<td>\r\n			<p>SpO2, CXR, Bronchoscopy</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&lt;!-- List --&gt; &lt;!-- List --&gt;\r\n\r\n<div class="workups-list">\r\n<h4><span>Gastrointestinal System</span></h4>\r\n\r\n<div class="top">\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>\r\n			<h3>Diagnosis</h3>\r\n			</th>\r\n			<th>\r\n			<h3>Investigations</h3>\r\n			</th>\r\n		</tr>\r\n	</thead>\r\n</table>\r\n</div>\r\n\r\n<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>GERD</p>\r\n			</td>\r\n			<td>\r\n			<p>EGD, 24 Hr pH monitoring, Barium swallow Xray</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Barrett&rsquo;s esophagus</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>EGD and biopsy</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Achalasia cardia</p>\r\n			</td>\r\n			<td>\r\n			<p>Barium swallow, <strong>Esophageal manometry</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Dyspepsia</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>EGD, </strong>H.Pylori Antibody testing</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Irritable bowel syndrome</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, LFT, FOBT, <strong>Stool analysis &amp; culture</strong>, Stool fat</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Cholecystitis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CRP, USG Abdomen, AXR</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Choledocholithiasis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CRP, USG Abd, AXR, ERCP</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Cholangitis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CRP, LFT, GGT, Bilirubin, ALP, Blood cultures, USG Abd, MRCP, ERCP</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Obstructive jaundice</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, AST, ALT, ALP, GGT, <strong>Indirect and total Bilirubin</strong>, MRCP, ERCP, USG Abd, CT Abd, HIDA sca</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Liver cirrhosis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, AST, ALT, Alk Phos, GGT, <strong>USG Abd, Liver Biopsy, Paracentesis</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Ascitis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CRP, TSH, <strong>Paracentesis</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Appendicitis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, Blood type and cross match, PT/INR, USG Abd, <strong>CT Abd </strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Pancreatitiss</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CRP, Lipase, Amylase, USG Abd, CT Abd, Electrolytes, Ca, Lipid profile, LFT</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Inflammatory bowel disease</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, FOBT, Stool analysis and culture, Fecal fat test, <strong>Colonoscopy</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Upper GI bleed</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>Endoscopy</strong>, LFT, Blood type and cross match, PT/INR, CBC, Electrolytes</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Lower GI bleed</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>Colonoscopy</strong>, Blood type and cross match, PT/INR, CBC, Electrolytes</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Colon Carcinoma/ Polyps</p>\r\n			</td>\r\n			<td>\r\n			<p>FOBT, Sigmoidoscopy,<strong>Colonoscopy</strong>, CBC</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Constipation</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, <strong>FOBT</strong>, TSH, Enema</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Hemorrhoids</p>\r\n			</td>\r\n			<td>\r\n			<p>Anoscopy, <strong>Sigmoidoscopy</strong>, CBC</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Diverticular disease</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, Blood culture, USG ABd, <strong>CT Abd</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Meckel&rsquo;s diverticulum</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, USG Abd, FOBT, Stool Analysis, <strong>Meckel scan</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Pheochromocytoma</p>\r\n			</td>\r\n			<td>\r\n			<p>24 Hr Urinary Metanephrins and VMA, <strong>Serum Metanephrin</strong>, CT/MRI Abd, MIBG scintigraphy</p>\r\n			</td>\r\n		</