><strong>CSF analysis</strong>, EMG and nerve conduction studies, Spirometry</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Normal pressure hydrocephalus</p>\r\n			</td>\r\n			<td>\r\n			<p>UA, <strong>CT/MRI brain</strong>, CSF analysis</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Subdural hematoma</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>CT head</strong>, Electrolytes, ABG</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&lt;!-- List --&gt; &lt;!-- List --&gt;\r\n\r\n<div class="workups-list">\r\n<h4><span>OBS/GYN</span></h4>\r\n\r\n<div class="top">\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>\r\n			<h3>Diagnosis</h3>\r\n			</th>\r\n			<th>\r\n			<h3>Investigations</h3>\r\n			</th>\r\n		</tr>\r\n	</thead>\r\n</table>\r\n</div>\r\n\r\n<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Vaginal discharge Eg: gonorrhe</p>\r\n			</td>\r\n			<td>\r\n			<p>Wet mount, <strong>Cervical gram stain &amp; culture</strong>, HIV Ab KOH prep, vaginal fluid pH, Cervical GC DNA test</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Vaginal Bleed</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, <strong>PT/INR</strong>Factor study, <strong>Colposcopy</strong>, Pap smear, Hysteroscopy</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Endometriosis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, Colposcopy, Pap smear, Hysteroscopy, <strong>Laproscopy</strong>, USG Abd.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Cervical Cacer</p>\r\n			</td>\r\n			<td>\r\n			<p>Pap smear, <strong>Colposcopy and biopsy</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Pregnancy</p>\r\n			</td>\r\n			<td>\r\n			<p>Urine hCG, UA, USG pelvis, CBC, Sr. Glucose, Blood type and cross match, Pap smear, Cervical GC DNA test, VDRL/RPR, Rubella IgG, HbsAg, HIV Ab, TSH</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Ectopic pregnancy</p>\r\n			</td>\r\n			<td>\r\n			<p>Urine hCG, <strong>Quantitative Sr. hCG, TVS</strong>, Blood type &amp; cross match</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Dyspareunia</p>\r\n			</td>\r\n			<td>\r\n			<p>Wet Mount, KOH prep, Cervical cultures, <strong>Laproscopy</strong>, USG Pelvis</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Amennorhea Eg: Hyperprolactinoma/ PCOS</p>\r\n			</td>\r\n			<td>\r\n			<p>Urine hCG, <strong>LH/FSH, Prolactin&gt;/strong&gt;, TSH, Electrolytes, Testosterone, DHEAS, MRI Brain, USG pelvis.</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Premature ovarian failure</p>\r\n			</td>\r\n			<td>\r\n			<p>GnRH, <strong>FSH</strong>, LH/FSH, Prolactin, TSH, MRI brain</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Asherman&rsquo;s Syndrome</p>\r\n			</td>\r\n			<td>\r\n			<p>Colposcopy, <strong>Hysterosalpingography</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>NDUB/ Fibroid</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, hCG, TSH, USG Abd, LH/FSH, GnRH</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>PID</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, USG Abd, Hysterosalpingography, Cervical gram stain &amp; culture, Blood culture, GC DNA probe</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&lt;!-- List --&gt; &lt;!-- List --&gt;\r\n\r\n<div class="workups-list">\r\n<h4><span>Pediatrics</span></h4>\r\n\r\n<div class="top">\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>\r\n			<h3>Diagnosis</h3>\r\n			</th>\r\n			<th>\r\n			<h3>Investigations</h3>\r\n			</th>\r\n		</tr>\r\n	</thead>\r\n</table>\r\n</div>\r\n\r\n<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Neonatal sepsis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CRP, <strong>Blood culture, UA and culture</strong>, CXR, LP, CSF analysis</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Viral Exanthem</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, <strong>Viral antibody titre</strong>, Throat swab</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>ADHD</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>Mental status exam</strong>, Urine toxicology</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Autism</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, Audiometry, Tympanometry, CT/MRI brain, Heavy metal screen, Complete metabolic panel, <strong>Autism Diagnostic Observation Schedule </strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Down Syndrome</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, CXR, <strong>Karyotype</strong>, Echo, Renal USG/Doppler, Audiometry/Tympanometry</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Neonatal Jaundice</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, <strong>Total and indirect bilirubin</strong>, Blood typing, Direct coomb&rsquo;s tes, CRP, Titres for CMV, Toxoplasma, Rubella</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Bed wetting</p>\r\n			</td>\r\n			<td>\r\n			<p>Genital exam, UA &amp; culture, USG &ndash;Renal, <strong>First morning urine specific gravity</strong>, FBS</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Seizure</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CRP, LP, <strong>Electrolytes, Sr. Glucose</strong>, CSF analysis, UA, Urine culture, CT head, Blood culture</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&lt;!-- List --&gt; &lt;!-- List --&gt;\r\n\r\n<div class="workups-list">\r\n<h4><span>General</span></h4>\r\n\r\n<div class="top">\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>\r\n			<h3>Diagnosis</h3>\r\n			</th>\r\n			<th>\r\n			<h3>Investigations</h3>\r\n			</th>\r\n		</tr>\r\n	</thead>\r\n</table>\r\n</div>\r\n\r\n<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Fever of Unknown Origin</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, Electrolytes, ESR, CRP, UA, Urine culture, Blood culture, CXR, CSF analysis</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Abuse</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, Skeletal survey, Toxicology screen, Wet mount, Urine HCG, HIV Ab, Hepatitis Serology, VDRL/RPR</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Diabetes follow up</p>\r\n			</td>\r\n			<td>\r\n			<p>FBS, Sr. Glucose, <strong>HbA1c</strong>, CBC, Lipid profile, UA, Urine microalbumin, BUN/Cr, Fundoscopy</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>HTN follow up</p>\r\n			</td>\r\n			<td>\r\n			<p>BUN/Cr, Electrolytes, Fundoscopy, Lipid profile, UA, <strong>ECG</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>HIV positive/ Immunodeficient</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, HIV Ab, Hepatitis panel, VDRL/RPR, <strong>CD4 count</strong>, Viral load, UA.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Infectious Mononucleosis</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>CBC</strong>, ESR, USG Abd</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Hoarsness</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>CBC</strong>, TSH, Laryngoscopy, CT</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Anemia</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC,Iron studies: TIBC, Iron Sat, Ferritin, Transferrin, Vit B12 level, Bone marrow biopsy, Sickling test, HbA2 levels, Hb electrophoresis</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Hyperthyroidism</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>TSH</strong>, T3, T4 levels, RAIU, Thyroid scan, FNAC (for nodules), Anti-TSH receptor antibodies, Thyroid scintigraphy, CKMB</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Hypoglycemia</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>RBS</strong>, Electrolytes</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Panic attack</p>\r\n			</td>\r\n			<td>\r\n			<p><strong>ECG</strong>, CBC, TSH, Toxicology screen, Sr VMA to r/o Pheochromocytoma, Caffeine levels</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Chronic fatigue syndrome</p>\r\n			</td>\r\n			<td>\r\n			<p>&lt; CBC, TSH, CKMB, Iron studies, Depression Index, Electrolytes, BUN/Cr, FBS, Sr Cortisol levels, CXR, USG Abd</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Depression</p>\r\n			</td>\r\n			<td>\r\n			<p>Depression Index, CBC, TSH, FBS, Sr Cortisol levels</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Nephrotic syndrome</p>\r\n			</td>\r\n			<td>\r\n			<p>UA, CMP, Lipid profile, Electrolytes, BUN/Cr, USG Abd, C3 level, Sr Cryoglobulin, Kidney biopsy</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Cellulitis</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, ESR, CRP, Doppler, Biopsy and <strong>culture</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Heat Exhaustion</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC,<strong>Electrolytes</strong>, UA, RBS, CKMB</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Addison&rsquo;s disease</p>\r\n			</td>\r\n			<td>\r\n			<p>CBC, Electrolytes, RBS, Ca, UA, BUN/Cr, ABG, ACTH <strong>stimulation test</strong>, CT/MRI Abd.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Erectile dysfunction</p>\r\n			</td>\r\n			<td>\r\n			<p>FBS, Sr. Prolactin, Testosterone, LH/FSH, Duplex USG, Penile nervous function,and <strong>Nocturnal penile tumescence</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>DKA</p>\r\n			</td>\r\n			<td>\r\n			<p>RBS, UA, Sr Ketones, Electrolytes, ABG, CBC, CRP, BUN/Cr, ECG</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n&lt;!-- List --&gt; &lt;!-- List --&gt;\r\n\r\n<div class="workups-list" id="abbreviations">\r\n<h4><span>List of Abbreviations used above:</span></h4>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; ESR - Erythrocyte sedimentation rate</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; CRP - C reactive protein</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; UA - Urine analysis</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;CXR - Chest Xray</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp; &nbsp;&nbsp;CSF - Cerebrospinal fluid</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; Ab - Antibody</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; Sr. - Serum</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; Cr - Creatinine</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; Sr. - Serum</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; Iron Sat - Iron Saturation</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; Abd - Abdomen</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; Abd - Abdomen</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; Ca - Calcium</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; TSH - Thyroid stimulating hormone</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; Sr. - Serum</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; TEE - Trans esophageal echo</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; TTE - Transthoracic echo</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; TFT - Thyroid function test</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; LFT - Liver function test</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; PFT - Pulmonary function test</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; Alk Phos - Alkaline phosphatase</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; FOBT - Fecal occult blood test</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; VDRL - Venereal disease research laboratory test</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; RPR - Rapid plasma reagin</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; USG - Ultrasonography</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; EMG - Electromyography</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; SFEMG - Single fibre electromyography</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; CPK - Creatinine phosphate kinase</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; SPECT - Single photon emission computed tomography</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; EEG - Electromyography</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;Anti CCP - Anti cyclic citrullinated peptide</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; hCG - Human chorionic gonadotrophin</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; GnRH - Gonadotrophin releasing hormone</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; LH - Luteinizing hormone</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; FSH - Follicle stimulating hormone</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp; CMV - Cytomegalo viru</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n&lt;!-- List --&gt; &lt;!-- List --&gt;</div>\r\n</div>\r\n</div>\r\n</section>', 0, 'Work ups', 'Meta Keyword Vinoth, Meta Keyword Vinoth', '<p>Meta Description Vinoth</p>\r\n', 1, '2017-12-01 14:41:53', '2017-12-22 17:19:08'),
(5, 'Areas Match', 'areas-match', '<section class="areas-match">\r\n<div class="container">\r\n<div class="row">\r\n<div class="areas-match-despt col-md-12 col-sm-12 col-xs-12">\r\n<div class="img-center"><img alt="" src="http://dev.blazedream.in/targetusmle_dev/assets/site/images/areas-match.png"></div>\r\n\r\n<p>USMLESarthi is a team IMG Attendings and Physicians which provides highly personalized expert one-on-one guidance services to IMGs seeking residency positions in the United States. We focus on the application process (ERAS CV, PS) and Interview Preparation. We have helped over 200 IMGs from 18 countries in the last four years to get their dream residency in the US. While there are several Residency Match services available, we pride ourselves on being unique and directly relevant to International Medical Graduates (IMGs).</p>\r\n\r\n<p>Some of the unique aspects of our services are:</p>\r\n\r\n<ul>\r\n <li>Our team has intricate knowledge of the US Medical System with our panel physicians having more than 20 years of combined clinical and research experience in the US in top tier institutes.</li>\r\n <li>As IMGs themselves, our team understands and can relate to the challenges, background, credentials and professional aspirations of the other IMGs preparing for US Residency.</li>\r\n <li>We apply a highly customized approach to each of our students and each student gets guidance and coaching directly from one of our panel physicians.</li>\r\n <li>We work with only IMGs and can help you even if you have low USMLE scores, no US clinical experience or clerkship, failure to match in previous attempts.</li>\r\n</ul>\r\n\r\n<p><span><strong>Please Call,</strong></span> <span>Text or Whatsapp - <a href="tel:+001-602-668-0653" title="+001-602-668-0653">+001-602-668-0653</a></span> <span>Visit our Website - <a href="http://www.usmlesarthi.com" title="http://www.usmlesarthi.com">http://www.usmlesarthi.com</a></span> <span>YouTube Channel - <a href="https://www.youtube.com/c/usmlesarthiSarthi" title="https://www.youtube.com/c/usmlesarthiSarthi">https://www.youtube.com/c/usmlesarthiSarthi</a></span> <span>To know who we can help you match!</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 0, '', '', '', 1, '2017-12-01 14:49:35', '2017-12-01 14:52:23'),
(6, 'Terms and Conditions', 'terms-and-conditions', '<section class="workups-section">\r\n<div class="container">\r\n<h1><span>Terms & Conditions</span></h1>\r\n<p>The United States Medical Licensing Examination (USMLE) is a joint program of the Federation of State Medical Boards (FSMB) and National Board of Medical Examiners (NBME). None of the trademark holders are affiliated with TARGET USMLE</p>\r\n</div>\r\n</section>', 0, 'terms and conditions', 'terms and conditions', 'terms and conditions', 1, '2017-12-22 17:26:12', '0000-00-00 00:00:00'),
