(16, 7, 'What is ecfmg step 2 cs?', '<p>Ecfmg step 2 cs bulletin is published well ahead of time - the previous year for international medical graduates (IMG) to plan your trip to the USA to take this unique exam. You should plan your exam dates/year according to the current ecfmg step 2 cs bulletin of the year you plan to take the exam</p>\r\n<p>Ecfmg step 2 cs bulletin is published well ahead of time - the previous year for international medical graduates (IMG) to plan your trip to the USA to take this unique exam. You should plan your exam dates/year according to the current ecfmg step 2 cs bulletin of the year you plan to take the exam</p>', 0, 1, '2017-11-27 13:05:34', '2017-12-04 12:19:41'),
(17, 7, 'What is ecfmg step 5  cs? can ypu please explain the same as it needs to be provided in advance?', '<p>Ecfmg step 2 cs bulletin is published well ahead of time - the previous year for international medical graduates (IMG) to plan your trip to the USA to take this unique exam. You should plan your exam dates/year according to the current ecfmg step 2 cs bulletin of the year you plan to take the exam</p>', 0, 1, '2017-11-27 13:05:40', '2017-12-04 12:20:34'),
(18, 21, 'What is STEP 2 CS?', 'Step 2 Clinical Skills (Step 2 CS) is one of the USMLE exams required as a pre requisite for getting ECFMG certified in the United States. Passing the Step 2 CS along with Step 1 (Basic Sciences) and Step 2 CK (Clinical Knowledge) gets your ECFMG Certified which allows you to be recognized as a physician in the USA.  Most residency programs require it as a pre-requisite before getting into residency.  You also need to be ECFMG certified for taking the USMLE Step 3.', 0, 1, '2017-12-15 17:19:21', '0000-00-00 00:00:00'),
(19, 21, 'When is it offered?', 'Step 2 CS is offered throughout the year except for a few days. Two sessions are available for you to pick in a day a.m. or p.m.', 0, 1, '2017-12-15 17:19:46', '0000-00-00 00:00:00'),
(20, 21, 'How long is the Step 2 CS exam?', 'The step 2 CS exam lasts for about 8 hours', 0, 1, '2017-12-15 17:20:24', '0000-00-00 00:00:00'),
(21, 21, 'What am I expected to do during the CS exam?', 'You are asked to examine a standardized patient in a clinical setting for 15 minutes and type patient note for 10 min.  There will be 12 cases overall. Information about each case will be displayed outside the door (Doorway information). You will have breaks after a couple of cases in a row.  For example 5 - break - 4 - break - 3 cases (or) 3-3-3-3 cases', 0, 1, '2017-12-15 17:21:07', '0000-00-00 00:00:00'),
(22, 20, 'What is a blue sheet?', '12 A4 size sheets that are blue in color are given at the beginning of your CS exam clipped onto a clipboard. They can be used to record vital information from patient, write mnemonics, write differentials.  The sheet has to be returned to the proctor after each encounter but it is not graded.', 0, 1, '2017-12-15 17:22:32', '0000-00-00 00:00:00'),
(23, 20, 'What are the details provided in the Doorway information?', 'The name, age, sex, vital signs (BP, Pulse, Respiratory Rate and Temperature in both Celsius and Fahrenheit) are displayed along with instructions of do’s and don’ts during the encounter.  You are requested to take a focused history and do a focused physical examination but not allowed to do any internal exams like pelvic, rectal or breast exam. If it is minor patient information regarding consent is also written in the doorway information.', 0, 1, '2017-12-15 17:23:01', '0000-00-00 00:00:00'),
(24, 19, 'What’s the passing score? Who grades each component?', 'There is no passing score on this exam.  The results are displayed as Pass OR Fail.  There is no numerical score.  There are 3 components that you need to pass individually to pass the Step 2 CS. \r\n1)	SEP – Spoken English Proficiency (graded by SP)\r\n2)	CIS – Communication Interpersonal Skills (graded by SP)\r\n3)	ICE – Integrated clinical encounter  (graded by SP and Physician)\r\n ICE includes Data Gathering & Patient note\r\n\r\nYou will be graded 10 out of 12 cases and the average of 10 evaluations will be calculated.', 0, 1, '2017-12-15 17:23:51', '0000-00-00 00:00:00'),
(25, 20, 'Why students fail ICE?', 'Recently many students have been failing the ICE component.  Both IMGs and AMGs.\r\nICE is a four step process: THINK, ASK, WRITE & TYPE.  Check out  coaching classes to learn more about this process.  99% of our students pass the ICE with high scores.  One has to recognize the ICE is graded by the physician who corrects the Patient notes and a small portion  comes in comes the SP’s judgement of your physical examination.', 0, 1, '2017-12-15 17:24:09', '0000-00-00 00:00:00'),
(26, 18, 'Why do I need a study partner?', 'Reading the books and knowing what to ask is one thing but practicing with a study partner is another thing.  It involves recall of questions, time efficiency and ofcourse dealing with another individual who can pose to be a challenging SP.', 0, 1, '2017-12-15 17:25:19', '0000-00-00 00:00:00'),
(27, 18, 'How do I pick the right study partner?', 'Watch this :https://www.youtube.com/watch?v=zyLXgRMohYY', 0, 1, '2017-12-15 17:25:54', '0000-00-00 00:00:00'),
(28, 18, 'What are the advantages / disadvantages between online and live study partners?', '<p>Online study partners are convenient - to travel , can study at odd hours and is safe. However for live interaction, communication skills, draping, washing hands, examining all of which take up time a live practice is more ideal.</p>', 0, 1, '2017-12-15 17:26:12', '2017-12-15 17:37:22'),
(29, 17, 'Where is it offered?', 'It is offered in 5 cities in the USA.  Chicago, Philadelphia, Houston, Atlanta and California.', 0, 1, '2017-12-15 17:26:40', '0000-00-00 00:00:00'),
(30, 17, 'How many Centres are there?', 'There are 6 centres  two of which are in Philadelphia', 0, 1, '2017-12-15 17:26:58', '0000-00-00 00:00:00'),
(31, 16, 'What is the ICE component?', 'ICE component judges both data gather and patient note. It is graded by the Physician and the SP (only the PE inside the room)', 0, 1, '2017-12-15 17:27:42', '0000-00-00 00:00:00'),
(32, 16, 'Why do many students fail the ICE component when compared to CIS, SEP?', 'ICE requires careful planning even during preparation.  Just asking a bunch of questions fluently in good English is not going to cut it.  It has to be specific to the case.', 0, 1, '2017-12-15 17:28:00', '0000-00-00 00:00:00'),
(33, 16, 'I failed my ICE in first attempt?  How can I improve?', 'Most students who failed the ICE passed the second attempt with personal coaching from Dr Mary June.  A personalized coaching rather than a class room set up is necessary to find out where YOU are going wrong.  You present cases and get critiqued and type PN under supervision. You may  sign up here …….', 0, 1, '2017-12-15 17:28:19', '0000-00-00 00:00:00'),
(34, 15, 'I am not a native English speaker . How do I improve my English?', 'No Answer available', 0, 1, '2017-12-15 17:29:20', '0000-00-00 00:00:00'),
(35, 15, 'How long does it take to improve my English?', '<p>No Answer Available</p>', 0, 1, '2017-12-15 17:29:58', '0000-00-00 00:00:00'),
(36, 14, 'What exactly is communication interpersonal skills?', 'CIS gauges how effectively you can be understandable by the standardized patient and also speak grammatically correct and eloquent enough to convince the patient to take a decision or to counsel him for his bad habits.  It also builds the rapport between the patient and the doctor and builds confidentiality.  The mannerisms of the doctor and professionalism also builds trust with the patient (for example looking into the eye of the patient while talking).', 0, 1, '2017-12-15 17:31:36', '0000-00-00 00:00:00'),
(37, 14, 'Why to even AMG’s fail the CIS component?', 'Most of the CIS components get judged in the last few minutes of the 15 minute encounter during closure the case. If the student has wasted time before the 15 min final call, he may not have time to close the case.  Several  unfinished cases can result in CIS failure.', 0, 1, '2017-12-15 17:31:53', '0000-00-00 00:00:00'),
(38, 13, 'It is really hard to finish my patient note in 10 min.  Help!!', 'Yeah it can be difficult at times especially if you have not practiced enough.  Sometimes it is not even the typing speed but the flow of though from your head to your fingers', 0, 1, '2017-12-15 17:32:17', '0000-00-00 00:00:00'),
(39, 13, 'What should I do to write a good patient?', 'Simple answer would be to enrol with us ? Target USMLE has helped several students who have failed the ICE component especially because of a bad patient note. We have excellent pass rates that are near 100% for second time takers', 0, 1, '2017-12-15 17:32:34', '0000-00-00 00:00:00'),
(40, 13, 'Any tips for saving time on PN?', 'Ask the right questions –focused history and PE \r\nJot down in your blue sheet \r\nPractice typing many patient notes before the real exam', 0, 1, '2017-12-15 17:32:53', '0000-00-00 00:00:00'),
(41, 12, 'What resources do I use for Step 2 CS preparation?', 'There are a lot of resources and methodologies that students use to prepare for CS. There are books that provide a lot of information but each student has to filter the numerous inputs and create a system that works for them.  Some videos online show how physical examination is done in a detailed manner but the student has to know how to edit it to fit it into the 15 min encounter that the Step 2 CS exam allows for a clinical encounter. Target USMLE video tutorials ‘7 Easy Step 2 CS’ shows how to do the PE manoeuvres within time.', 0, 1, '2017-12-15 17:33:40', '0000-00-00 00:00:00'),
(42, 11, 'Is it better to study alone or with a partner?', '<p>Definitely with a study partner for this particular exam. One can act as a doctor and the other as a patient</p>', 0, 1, '2017-12-15 17:33:56', '2017-12-15 17:35:21'),
(43, 11, 'There is so much material out there? Which one to pick?', '<p>Pick a material that suits your style of reading and preparing. There are many books out there but who is going to test you to see if that material worked per se? When you go to coaching classes they dump their material on top of what you already used as the standard material everyone follows. There is so much repetition, confusion and not an organized approach to this time pressured exam. At Target USMLE we have a system which offers you the material ( CS handbook &amp; Online video tutorial) and the assessments (Assess my Prep &amp; Patient note correction) at a personal level and we also give you mock exams (Online and Live) to get the real feel of the exam. That why we call it the one stop solution to Step 2 CS. Do it once! Do it right!</p>', 0, 1, '2017-12-15 17:34:22', '2017-12-15 17:35:36'),
(44, 11, 'What is the best way to study for CS?', 'Right material. Right coach with experience of at least 5 years not one who has just cleared the exam! Right partner, who follows the same methodology and who is in the same phase of prep and medical knowledge as you.  Otherwise it would be a big waste of time.  Then ‘practice, practice practice’ after learning the right way to do each case.', 0, 1, '2017-12-15 17:35:00', '0000-00-00 00:00:00'),
(45, 10, 'How long do I have to study for Step 2 CS?', 'Typically medical students take 2 - 4 weeks for preparation.  Depending on whether you are an American Medical Graduate (AMG) or an International Medical graduate (IMG) the timing of preparation will vary as you will have to factor in, training yourself to interact with a patient the American way!  You also need to consider travel time to and fro from your country. Some students need 2-3 months to improve their Spoken English proficiency and/or typing speed as the patient note has to be typed and not hand written.', 0, 1, '2017-12-15 17:35:55', '0000-00-00 00:00:00'),
(46, 15, 'What resources are available to improve my English?', 'No Answer Available', 0, 1, '2017-12-15 17:39:48', '0000-00-00 00:00:00');
