INSERT INTO `product_attributes` (`id`, `product_id`, `content_one`, `content_two`, `content_three`, `content_four`, `content_five`, `video_url`, `image`, `product_included`, `included_valid_days`, `created`, `modified`) VALUES
(1, 1, 'Standard CS Encounter', 'If you are a beginner for CS Prep (or) you need to know how to present any standard case (general format) for Step 2 CS (or) you need to know all the MUST DO steps for this exam, this module will take you through in 6 easy lectures. Few lectures are accompanied by the actual enacting of that lecture segment by doctor and patient. When you have completed this module, you are confident to present cases and ready to practice (student feedback)', 'new', 'NULL', 'NULL', 'https://www.youtube.com/embed/zyLXgRMohYY?&controls=0&showinfo=0&rel=0', 'step6-bot-bg.png', '', 0, '2017-10-24 14:57:48', '2017-10-24 14:57:48'),
(2, 2, 'System wise History Taking', 'This module is an add-on to step 1 standard history taking module. The lectures train you to take a FOCUSED history for each System eg. Cardiology, Respiratory, Nervous etc which is crucial for passing the Data Gathering part of ICE for Step 2 CS.', 'NULL', 'NULL', 'NULL', 'https://youtu.be/WO1BbP1YBHkp8', 'step6-bot-bg1.png', '', 0, '2017-10-24 15:42:32', '2017-10-24 15:42:32'),
(3, 3, 'Physical Exam Videos', 'This module shows videos of the doctor performing a focused Physical Exam for each system in ~ 4 minutes. This includes not only the main system but also the allied systems that you are likely to examine for the case at hand. The module shows you how to manage time, build rapport and keep the patient informed as you perform your PE. Helps pass ICE and CIS component of the Step 2 CS exam.', 'NULL', 'NULL', 'NULL', 'https://youtu.be/mo4lahZGTMc', 'step6-bot-bg2.png', '', 0, '2017-10-24 15:45:22', '2017-10-24 15:45:22'),
(4, 4, 'Differential Diagnosis', 'This module allows you to tune your medical knowledge/experience to suit the Step 2 CS format of testing. It is of utmost importance to organize your medical knowledge to a pattern of thinking not only while interviewing the patient but also writing the patient notes. You might have passively studied 8 causes of chest pain but this interactive interface allows you to check whether you are able to think quickly on your feet and convert all the theoretical book knowledge into practical quick processing skills to elicit a good history & PE, which is needed to pass this unique exam. When you work on this module you will be able to ask the correct set of questions for each door way complaint and also ace the History and PE column of the new patient note format in the Diagnostic Interpretation section! This is the first updated resource to our knowledge to help students study according to the new patient note format (changed in June 2012). Helps pass ICE (both data gathering and patient note)', 'NULL', 'NULL', 'NULL', 'https://youtu.be/loLVtZz16x8', 'step6-bot-bg3.png', '', 0, '2017-10-24 15:45:22', '2017-10-24 15:45:22'),
(5, 5, 'Full 15 min Encounter', 'This module has 10 (ten) Full 15-minute Encounters of different systems a) Cardio b) Respiratory c) Obs/Gyn (2 cases) d) Abdomen e) Nervous f) HEENT g) Joint h) Psychiatry i) Paediatrics . Having gone through Modules 1-4, it is time to see how to input it all together in a 15 min time constrained manner! Enacted with American SPï¿½s in a Step 2 CS simulated environment (medical equipment use, patient table adjustments, good CIS, challenging Qï¿½s & situations etc ), it gives you a good idea of all 3 components needed to pass the exam - CIS skills, ICE & SEP.', 'NULL', 'NULL', 'NULL', 'https://youtu.be/sYoPNRxVkKo', 'step6-bot-bg4.png', '', 0, '2017-10-24 15:46:16', '2017-10-24 15:46:16'),
(6, 6, 'Patient Notes (PN)', 'This module has lectures on essentials of each section of the PN (HPI, PE, DD, Diagnostic Work up), what goes into each section, the pertinent positives and negatives and has lots of tips on managing the time without compromising on recording all the information you gathered orally on the computer. You will find many samples of ideal PNs and corrected PNs (system wise) of common mistakes that students make in the step 2 CS exam. The diagnostic work up for each diagnosis under each system is also given in a tabular column. Helps pass ICE, both data gathering and patient notes of the step 2 CS exam.', '', 'NULL', 'NULL', 'https://youtu.be/POeu70V20Sohttp://', 'step6-bot-bg5.png', '', 0, '2017-10-24 15:46:16', '2017-10-24 15:46:16'),
(7, 7, '<h2>RAPID REVIEW COURSE <i>(RRC) 1-2 weeks</i></h2>', '<h3>RRC prepares students who</h3>\r\n<ul>\r\n<li>Have short time to prepare</li>\r\n<li>Who have prepared with other resources and still don’t feel ready</li>\r\n<li> Failed previously</li>\r\n<li>Need a last week confidence booster</li>\r\n</ul>', '<h5>30 Days Video Tutorials & <i>CS Handbook Free</i></h5>', 'NULL', 'NULL', 'http://www.youtube.com', 'img12.png', '12,6,5,4,3,2,1', 30, '2017-10-31 15:46:16', '2017-10-31 15:46:16'),
(8, 8, '<h2>COMPLETE COMPREHENSIVE COURSE (CCC) 3-4 weeks</i></h2>', '<h3>CCC prepares students who</h3>\r\n<ul>\r\n<li>Need a personal coach and a hand held course</li>\r\n<li>Need individual observation & correction</li>\r\n<li>Have more than a month before exam</li>\r\n<li>Are starting prep from scratch</li>\r\n<li>Need every resource that Target has to offer online</li>\r\n</ul>', '<h5>60 Days Video Tutorials & <i>CS Handbook Free</i></h5>', 'NULL', 'NULL', 'http://www.youtube.com', 'img111.png', '12,6,5,4,3,2,1', 60, '2017-10-31 15:46:16', '2017-10-31 15:46:16'),
(9, 11, 'Personal Assessment with Dr June', 'On Spot Assessment on your preparation', '<ul>\r\n    <li>Present Case</li>\r\n    <li>Patient Note</li>\r\n    <li>Critique</li>\r\n    <li>Note Correction</li>\r\n</ul>', '<h2>Book Your Time Slot</h2>\r\n<p>Dr Mary June & Target USMLE tutors are available most weekdays to offer you the best personal coaching to pass Step 2 CS the first time! Please pick a time slot from the calendar below that is convenient for you. Unattended time slots will not be rescheduled/refunded.  In unforeseen emergency  you may send in a request  in writing 24 hours prior via email to support@targetusmle.com. First come first served!.</p>', 'NULL', 'http://www.youtube.com', '', '', 0, '2017-10-31 15:46:16', '2017-10-31 15:46:16'),
(10, 10, 'Patient Note (PN)', '<h2>Patient Note Correction</h2>\r\n<ul>\r\n<li>Present a case – 15 min</li>\r\n<li>Type Patient note live for the case presented in 10 min</li>\r\n<li>MD s will be monitoring you as you type online</li>\r\n<li>Corrections, tricks & time saver tips to write a good patient note</li>\r\n<li>Additional patient note correction.</li>\r\n</ul>', '<h2>Book Your Time Slot</h2>\r\n<p>Dr Mary June & Target USMLE tutors are available most weekdays  to offer you the best personal coaching to pass Step 2 CS the first time! Please pick a time slot from the calendar below that is convenient for you.   Unattended time slots will not be rescheduled/refunded.  In unforeseen emergency  you may send in a request  in writing 24 hours prior via email to support@targetusmle.com. First come first served!</p>', 'NULL', 'NULL', 'https://www.youtube.com/embed/xg56hxkqmII', 'banner2.jpg', '', 0, '2017-10-31 17:46:16', '2017-10-31 18:46:16'),
(11, 9, 'Online Mock Exam', '<ul>\r\n<li>Let’s say you have prepared on your own - reading books, practicing with other students who are also in the same boat as you. How do you know if you are doing it right? You do not want to be asking this question after taking your CS exam. Right? Get assessed! Do it once! Do it right</li>\r\n<li>If you can’t get to one of our live workshops because of your work Schedule, family commitments, time  or budget constraints this is your best option - a personalized evaluation of ICE, SEP & CIS from the comfort of your home by experts</li>\r\n<li>No cost of flying to city where Live workshops are conducted</li>\r\n<li>No cost of staying in hotels for the entire duration of the workshop</li>\r\n<li>Best value for your money!</li>\r\n</ul>', '<h2>Each Case</h2>\r\n<ul>\r\n<li>15 mins encounter</li>\r\n<li>10 mins patient note Personalized feedback at the end of the 3 cases on  History taking (data gathering), PE, CIS SEP</li>\r\n<li>Online live patient note correction</li>\r\n<li>Monitoring of PN typing skills for time saving suggestions</li>\r\n<li>Must do ‘s and don’t’s </li>\r\n</ul>', '<h2>Time Duration : 2 Hours</h2>\r\n<p>Practice three cases <span>Back to back?</span></p>', '<h2>Book Your Time Slot</h2>\r\n<p>Dr Mary June & Target USMLE tutors are available most weekdays  to offer you the best personal coaching to pass Step 2 CS the first time! Please pick a time slot from the calendar below that is convenient for you.   Unattended time slots will not be rescheduled/refunded.  In unforeseen emergency  you may send in a request  in writing 24 hours prior via email to support@targetusmle.com. First come first served!.</p>', 'https://www.youtube.com/embed/mReGTloHonE', 'view3.png', '', 0, '2017-11-02 17:46:16', '2017-11-02 18:46:16'),
(12, 12, 'CS Handbook', '<h2>Why Should Pick Up The CS Handbook?</h2>\r\n      <ul>\r\n       <li>I am looking for a simple organized approach to CS</li>\r\n       <li>I want to be confident to present ANY case in the CS exam</li>\r\n       <li>I need to be organized in my approach to the patient during the 15 min encounter</li>\r\n       <li>I just need the essentials & not the  extraneous clutter out there.</li>\r\n       <li>I have very little time before my exam & need a quick read</li>\r\n       <li>I need to write a good patient note & pass ICE first time</li>\r\n       <li>If I need tips to crack SEP, CIS, challenging situations and beat the time factor</li>\r\n       <li>If you said ‘Yes’ to any of the above click below</li>\r\n      </ul>', '<h2>Clinical Skills Director Johns Hopkins</h2>\r\n    <p>"Dr. June''s personal one on one coaching helped me to focuson my individual deficits in the preparation for \r\n    the exam. The mock session at the Chennai test centre was conducted in an impeccable manner. The SPs were well trained and it  simulated the actual exam"</p>', 'Practice Three cases back to back...', 'Bottom content...', 'https://www.youtube.com/embed/7c_aGn4NCYI', 'Target_USMLE.png', '', 0, '2017-11-02 17:46:16', '2017-11-02 18:46:16'),
(13, 18, 'Silver', '<ul> 										\r\n<li>CS Handbook</li> 										\r\n<li>CS Video tutorials</li> 										\r\n<li>(30 day access)</li> 	\r\n<li>&nbsp;</li> 	\r\n<li>&nbsp;</li> 									</ul>', 'NULL', 'NULL', 'NULL', 'http://www.youtube.com', '', '12,6,5,4,3,2,1', 30, '2017-11-08 00:00:00', '2017-11-08 00:00:00'),
(14, 19, 'Gold', '<ul><li>CS Handbook</li> 										\r\n<li>CS Video Tutorials</li> 	\r\n<li>(30 day access)+</li> 										\r\n<li>Assess My Prep</li> \r\n<li>&nbsp;</li> 									\r\n</ul>', 'NULL', 'NULL', 'NULL', 'http://www.youtube.com', '', '12,6,5,4,3,2,1', 30, '2017-11-08 00:00:00', '2017-11-08 00:00:00'),
(15, 20, 'Diamond', '<ul> 										\r\n<li>CS Handbook</li> 										\r\n<li>CS Video Tutorials</li> <li>(30 day access)+</li>\r\n<li>Patient Note Correction</li> 										\r\n<li>(live Online)</li> 									\r\n</ul>', 'NULL', 'NULL', 'NULL', 'http://www.youtube.com', '', '12,6,5,4,3,2,1,10', 30, '2017-11-08 00:00:00', '2017-11-08 00:00:00'),
