(118, 4, 'COPD/Acute Bronchitis', 'copdacute-bronchitis-1', 107, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Cough with sputum (white, yellow or green)</p>\r\n			</td>\r\n			<td>\r\n			<p>Respiratory rate may be high</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>SOB especially during physical activities</p>\r\n			</td>\r\n			<td>\r\n			<p>Lungs : Rales and Rhonchi</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>H/O clearing throat first thing in the morning to clear the excess mucus secretion</p>\r\n			</td>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Productive sputum 3 months each year(at least 2 consecutive years)</p>\r\n			</td>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Smoker</p>\r\n			</td>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Chest tightness</p>\r\n			</td>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Fatigue</p>\r\n			</td>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Wheezing</p>\r\n			</td>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n', '', '', '', '', '', 2, 1, 0, '2017-11-13 04:20:44', '2018-01-08 09:32:58'),
(119, 4, 'Anaphylaxis', 'anaphylaxis', 107, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>h/o of exposure to allergen: peanuts ingestion, bee sting</p>\r\n			</td>\r\n			<td>\r\n			<p>Tachnpoeic</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Skin : itching, flushed or pale skin</p>\r\n			</td>\r\n			<td>\r\n			<p>Weak Rapid pulse</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>A feeling of warmth</p>\r\n			</td>\r\n			<td>\r\n			<p>Hypotension</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Difficulty breathing : SOB, wheezing , constriction of airways</p>\r\n			</td>\r\n			<td>\r\n			<p>Rhonchi</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Nausea,vomiting,diarrhea</p>\r\n			</td>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n', '', '', '', '', '', 3, 1, 0, '2017-11-13 04:21:10', '2018-01-08 09:33:35'),
