(382, 4, 'Joint- Septic Arthritis RA', 'joint-septic-arthritis-ra', 368, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n<tr>\r\n			<td>\r\n			<p>Fever & chills</p>\r\n			</td>\r\n			<td>\r\n			<p>Redness</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Warm, red immobile joint</p>\r\n			</td>\r\n			<td>\r\n			<p>tenderness</p>\r\n			</td>\r\n		</tr>\r\n	<tr>\r\n			<td>\r\n			<p>swelling of the joint</p>\r\n			</td>\r\n			<td>\r\n			<p>immobility</p>\r\n			</td>\r\n		</tr>\r\n	<tr>\r\n			<td>\r\n			<p>H/o STDs</p>\r\n			</td>\r\n			<td>\r\n			<p>effusions</p>\r\n			</td>\r\n		</tr>\r\n	\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<h4>Rheumatoid Arthritis</h4>\r\n\r\n<div class="top">\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>\r\n			<h3>History</h3>\r\n			</th>\r\n			<th>\r\n			<h3>Physical Exam</h3>\r\n			</th>\r\n		</tr>\r\n	</thead>\r\n</table>\r\n</div>\r\n\r\n<div class="bot">\r\n<table style="width:100%;">\r\n	<tbody>\r\n<tr>\r\n			<td>\r\n			<p>Knee pain bilaterally</p>\r\n			</td>\r\n			<td>\r\n			<p>Swelling of the joint</p>\r\n			</td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Usually b/l metacarpophalangeal joints and multiple joints symmetrically involved</p>\r\n			</td>\r\n			<td>\r\n			<p>Restricted range of motion in all affected joints B/L</p>\r\n			</td>\r\n		</tr>\r\n	\r\n<tr>\r\n			<td>\r\n			<p>Morning stiffness for more than one hour, improving as the day progresses</p>\r\n			</td>\r\n			<td>\r\n			<p>Rheumatoid nodules</p>\r\n			</td>\r\n		</tr>\r\n	\r\n<tr>\r\n			<td>\r\n			<p>Constitutional symptoms of fatigue, weight loss, malaise, anorexia</p>\r\n			</td>\r\n			<td>\r\n			<p>Deformities of fingers like Boutenniere, Swan neck, radial deviation of the wrist with ulnar deviation of the digits</p>\r\n			</td>\r\n		</tr>\r\n	\r\n\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n\r\n\r\n', '', '', '', '', '', 7, 1, 0, '2017-12-13 02:13:22', '2017-12-13 04:15:11'),
