(447, 4, 'Varicella', 'varicella', 445, '<div class="bot">\r\n<table>\r\n<tbody>\r\n\r\n\r\n	<tr><td><p>Fever</p></td><td><p>Low grade fever</p></td></tr>\r\n				<tr><td><p>Skin rash on body and trunk that spread to extremities</p></td><td><p>Skin lesions in crops at different stages from vesicles to pustules to crusting</p></td></tr>\r\n				<tr><td><p>H/o exposure to similar symptoms</p></td><td><p> Oral ulcers</p></td></tr>\r\n				<tr><td><p>Intense pruritis</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>May have prodrome of nausea, malaise, decreased appetite, headache</p></td><td>&nbsp;</td></tr>\r\n\r\n</tbody>\r\n</table>\r\n</div>\r\n', '', '', '', '', '', 2, 1, 0, '2017-12-13 06:15:35', '2017-12-13 06:23:56'),
