(449, 4, 'Secondary Syphilis', 'secondary-syphilis', 445, '<div class="bot">\r\n<table>\r\n<tbody>\r\n\r\n\r\n				<tr><td><p>H/o genital ulcer- painless 2 months back</p></td><td><p> Cataplexy may be elicited</p></td></tr>\r\n				<tr><td><p>Generalized rash- started on the trunk and spread to involve palms and soles</td><td> <p>Maculopaular/ pustular rash.</p></td></tr>\r\n				<tr><td><p>Malaise</p></td><td><p> Condylomata lata – wart like flat lesions</p></td></tr>\r\n				<tr><td><p>Weight loss</p></td><td> <p>Mucous patches maybe present</p></td></tr>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</tbody>\r\n</table>\r\n</div>\r\n', '', '', '', '', '', 4, 1, 0, '2017-12-13 06:16:20', '2017-12-13 06:28:09'),
