(543, 4, 'Lumbar Disc Prolapse ', 'lumbar-disc-prolapse', 540, '<div class="bot">\r\n<table>\r\n<tbody> \r\n\r\n<tr><td><p>Acute onset pain lower back (sudden onset)</p></td><td><p>Positive SLR test</p></td></tr>\r\n					<tr><td><p>Pain increased on coughing , sneezing</p></td><td><p>Local tenderness</p></td></tr>\r\n					<tr><td><p>Pain relieved in certain positions that allow spine to relax</p></td><td><p>Decreased sensation over dermatome</p></td></tr>\r\n					<tr><td><p>May be associated with sharp shooting pain down the leg ( sciatica)/numbness/weakness/tingling</p></td><td>&nbsp;</td></tr>\r\n					<tr><td><p>Previous h/o stroke</p></td><td>&nbsp;</td></tr>\r\n					<tr><td><p>Onset may be associated with history of lifting heavy objects</p></td><td>&nbsp;</td></tr>\r\n				\r\n\r\n\r\n</tbody>\r\n</table>\r\n</div>', '', '', '', '', '', 1, 1, 0, '2017-12-14 11:42:47', '2017-12-14 11:42:47'),
