(547, 4, 'Mesenteric ischemia', 'mesenteric-ischemia-1', 258, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Abdominal pain after eating (out of proportion to the signs) Weight loss because of fear of pain after eating</p>\r\n			</td>\r\n			<td>\r\n			<p>Pallor</p>\r\n			</td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Blood in stools</p>\r\n			</td>\r\n			<td>\r\n			<p>Decreased peripheral pulses, Carotid bruit</p>\r\n			</td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>H/o Atherosclerotic vascular disease elsewhere in the body like angina, intermittent claudication or TIA</p>\r\n			</td>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Age, risk factors for atherosclerosis like DM, HTN, Hypercholestrolemia</p>\r\n			</td>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n\r\n\r\n	</tbody>\r\n</table>\r\n</div>', '', '', '', '', '', 6, 1, 0, '2017-12-14 11:44:14', '2017-12-14 12:06:44'),
