(594, 4, 'Pervasive development disorder', 'pervasive-development-disorder', 514, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr><td><p>Boys</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Lack peer relationships, poor eye contact, social smile</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Absent or bizarre speech</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Repetitive behaviors – spinning, banging head</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Self injurious behavior</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Lack separation anxiety</p></td><td>&nbsp;</td></tr>\r\n				\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<h4>Rett disorder</h4>\r\n\r\n<div class="top">\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>\r\n			<h3>History</h3>\r\n			</th>\r\n			<th>\r\n			<h3>Physical Exam</h3>\r\n			</th>\r\n		</tr>\r\n	</thead>\r\n</table>\r\n</div>\r\n\r\n<div class="bot">\r\n<table style="width:100%;">\r\n	<tbody>\r\n <tr><td><p>Girls</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Hand wringing</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Loss of speech</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Psychomotor retardation</p></td><td>&nbsp;</td></tr>\r\n			</tbody>\r\n</table>\r\n</div>\r\n\r\n\r\n\r\n\r\n\r\n<h4>Childhood disintegrative disorder</h4>\r\n\r\n<div class="top">\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>\r\n			<h3>History</h3>\r\n			</th>\r\n			<th>\r\n			<h3>Physical Exam</h3>\r\n			</th>\r\n		</tr>\r\n	</thead>\r\n</table>\r\n</div>\r\n\r\n<div class="bot">\r\n<table style="width:100%;">\r\n	<tbody>\r\n<tr><td><p>Normal development for 2 years, then marked regression in functioning</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Loss of language</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Social interaction</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Motor function</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Bladder function</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Repetitive behavior</p></td><td>&nbsp;</td></tr>\r\n			</tbody>\r\n</table>\r\n</div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<h4>Asperger disorder</h4>\r\n\r\n<div class="top">\r\n<table>\r\n	<thead>\r\n		<tr>\r\n			<th>\r\n			<h3>History</h3>\r\n			</th>\r\n			<th>\r\n			<h3>Physical Exam</h3>\r\n			</th>\r\n		</tr>\r\n	</thead>\r\n</table>\r\n</div>\r\n\r\n<div class="bot">\r\n<table style="width:100%;">\r\n	<tbody>\r\n\r\n<tr><td><p>Problems in social interaction and behavior</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Normal language and intellectual skills</p></td><td>&nbsp;</td></tr>\r\n				<tr><td><p>Preoccupied with rules</p></td><td>&nbsp;</td></tr>\r\n			</tbody>\r\n</table>\r\n</div>\r\n\r\n', '', '', '', '', '', 10, 1, 0, '2017-12-14 12:26:00', '2017-12-14 12:47:25'),
