(638, 4, 'Keratosis obturans', 'keratosis-obturans', 603, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n<tr>\r\n			<td>\r\n			<p>Pain</p>\r\n			</td>\r\n			<td>\r\n			<p>Whitish flakes of desquamated skin of canal mixed with brownish cerumen is seen as mass in external auditory canal</p>\r\n			</td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Deafness</p>\r\n			</td>\r\n			<td>\r\n			<p>Bony erosion with surrounding hyperaemia of skin & granulations are seen </p>\r\n			</td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Scanty discharge</p>\r\n			</td>\r\n			<td>\r\n			<p>Skin is very thin, fragile and ulcerated</p>\r\n			</td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Tinnitus</p>\r\n			</td>\r\n			<td>\r\n			<p></p>\r\n			</td>\r\n		</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n', '', '', '', '', '', 2, 1, 0, '2017-12-14 12:46:31', '2017-12-14 05:52:22'),
