(786, 4, 'Urinary Tract Infection -UTI', 'urinary-tract-infection-uti-1', 785, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong style="margin-left: 10px;">Cystitis</strong>\r\n			<ul>\r\n				<li>\r\n				<p>Urgency</p>\r\n				</li>\r\n				<li>\r\n				<p>Increased frequency</p>\r\n				</li>\r\n				<li>\r\n				<p>Mild fever (rarely)</p>\r\n				</li>\r\n				<li>\r\n				<p>Unprotected sex</p>\r\n				</li>\r\n				<li>\r\n				<p>Burning while passing urine</p>\r\n				</li>\r\n				<li>\r\n				<p>Suprapubic pain/discomfort</p>\r\n				</li>\r\n				<li>\r\n				<p>If blood is present in the urine along with the above findings- ask for drugs e,g., cyclophosphamide, and also schistosomiasis</p>\r\n				</li>\r\n			</ul>\r\n			</td>\r\n			<td>\r\n			<p>Suprapubic tenderness</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong style="margin-left: 10px;">Urethritis</strong><br />\r\n			<p>same as cystitis + history of instrumentation (TURP, bladder catheterization)</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong style="margin-left: 10px;">Pyelonephritis</strong>\r\n			<ul>\r\n				<li>\r\n				<p>Flank pain</p>\r\n				</li>\r\n				<li>\r\n				<p>High fever</p>\r\n				</li>\r\n				<li>\r\n				<p>Recent untreated UTI, STD</p>\r\n				</li>\r\n				<li>\r\n				<p>Polyuria</p>\r\n				</li>\r\n			</ul>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n', '', '', '', '', '', 1, 1, 0, '2017-12-14 05:23:28', '2017-12-18 03:33:08'),
(787, 4, 'Nephrolithasis', 'nephrolithasis', 785, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Flank pain spasmodic</p>\r\n			</td>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Pain radiating from loin to groin</td>\r\n			<td>\r\n			<p>&nbsp;</p></td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Family history of renal stones- usually calcium stones </p></td>\r\n			<td>\r\n			<p>&nbsp;</p></td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Crohn’s disease- can cause oxalate stones ( ask for bowel habits, blood in stools, red eye, joint pain, erythema nodosum)</td>\r\n			<td>\r\n			<p>&nbsp;</p></td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Type of diet (spinach/wheat bran – oxalate stones, animal protein – uric acid stones)</td>\r\n			<td>\r\n			<p>&nbsp;</p></td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Poisoning with antifreeze Ethylene glycol ingestion (oxalate stones)</td>\r\n			<td>\r\n			<p>&nbsp;</p></td>\r\n		</tr>\r\n\r\n\r\n\r\n	</tbody>\r\n</table>\r\n</div>', '', '', '', '', '', 2, 1, 0, '2017-12-14 05:23:51', '2017-12-14 05:28:49'),
(788, 4, 'Glomerulonephritis', 'glomerulonephritis', 785, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Preceding upper respiratory tract infections</p>\r\n\r\n			<ul class="list-disc">\r\n				<li><p>1-2 days before ( children, IG A glomerulonephritis)</p></li>\r\n				<li><p>7-10 days before (Post streptococcal)</p></li>\r\n			</ul>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Runny nose, sinusitis, bloody nasal discharge, cough, shortness of breath, hemoptysis (Wegner&rsquo;s, Goodpastures)</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Blood in urine</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n', '', '', '', '', '', 3, 1, 0, '2017-12-14 05:24:20', '2017-12-14 05:58:08'),
