(791, 4, 'Polycystic kidney disease', 'polycystic-kidney-disease', 785, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Abdominal pain</p>\r\n			</td>\r\n			<td>\r\n			<p>O/E- bilateral flank fullness, high blood pressure </p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Positive family history/past history of intracranial aneurysm or bleed </td>\r\n			<td>\r\n			<p>&nbsp;</p></td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Past history of liver cyst</td>\r\n			<td>\r\n			<p>&nbsp;</p></td>\r\n		</tr>\r\n\r\n	</tbody>\r\n</table>\r\n</div>', '', '', '', '', '', 6, 1, 0, '2017-12-14 05:25:43', '2017-12-14 05:34:19');
