(792, 4, 'Bleeding disorder', 'bleeding-disorder', 785, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Excessive bleeding from minor cuts</p>\r\n			</td>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Family history of bleeding disorder</td>\r\n			<td>\r\n			<p>&nbsp;</p></td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>Hemarthrosis- joint swelling and pain</td>\r\n			<td>\r\n			<p>&nbsp;</p></td>\r\n		</tr>\r\n<tr>\r\n			<td>\r\n			<p>H/o of blood thinning medications- aspirin etc</td>\r\n			<td>\r\n			<p>&nbsp;</p></td>\r\n		</tr>\r\n\r\n\r\n	</tbody>\r\n</table>\r\n</div>', '', '', '', '', '', 7, 1, 0, '2017-12-14 05:26:01', '2017-12-14 05:35:38'),
(793, 4, 'STD- Clamydia, Gonorrhea', 'std-clamydia-gonorrhea', 259, '<div class="bot">\r\n<table>\r\n<tbody> <tr>\r\n\r\n						<tr>\r\n						<td><strong style="margin-left: 10px;">Cystitis</strong>\r\n							<ul class="list-disc">\r\n								<li><p>Urgency</p></li>\r\n								<li><p>Increased frequency</p></li>\r\n								<li><p>Mild fever (rarely)</p></li>\r\n								<li><p>Unprotected sex</p></li>\r\n								<li><p>Burning while passing urine</p></li>\r\n								<li><p>Suprapubic pain/discomfort </p></li>\r\n								<li><p>If blood is present in the urine along with the above findings- ask for drugs e,g., cyclophosphamide, and also schistosomiasis</p></li>\r\n							</ul>\r\n						</td>\r\n						<td><p>Suprapubic tenderness</p></td>\r\n					</tr>\r\n					<tr>\r\n						<td><strong style="margin-left: 10px;">Urethritis</strong><br>\r\n							<p>Same history as cystitis + history of instrumentation (TURP, bladder catheterization)</p>\r\n						</td>\r\n						<td>&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td><strong style="margin-left: 10px;">Pyelonephritis</strong>\r\n							<ul class="list-disc">\r\n								<li><p>Flank pain</p></li>\r\n								<li><p>High fever</p></li>\r\n								<li><p>Recent untreated UTI, STD</p></li>\r\n								<li><p>Polyuria</p></li>\r\n							</ul>\r\n						</td>\r\n						<td><p>Renal angle tenderness;</td>\r\n					</tr>\r\n</table>\r\n</div>\r\n\r\n', '', '', '', '', '', 7, 1, 0, '2017-12-14 06:40:27', '2017-12-14 06:40:46'),
(795, 4, 'Urinary tract infection - urethritis, cystitis, pyelonephritis', 'urinary-tract-infection-urethritis-cystitis-pyelonephritis', 259, '<div class="bot">\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong style="margin-left: 10px;">Cystitis</strong>\r\n			<ul class="list-disc">\r\n				<li>\r\n				<p>Urgency</p>\r\n				</li>\r\n				<li>\r\n				<p>Increased frequency</p>\r\n				</li>\r\n				<li>\r\n				<p>Mild fever (rarely)</p>\r\n				</li>\r\n				<li>\r\n				<p>Unprotected sex</p>\r\n				</li>\r\n				<li>\r\n				<p>Burning while passing urine</p>\r\n				</li>\r\n				<li>\r\n				<p>Suprapubic pain/discomfort</p>\r\n				</li>\r\n				<li>\r\n				<p>If blood is present in the urine along with the above findings- ask for drugs e,g., cyclophosphamide, and also schistosomiasis</p>\r\n				</li>\r\n			</ul>\r\n			</td>\r\n			<td>\r\n			<p>Suprapubic tenderness</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong style="margin-left: 10px;">Urethritis</strong>\r\n			<p>Same history as cystitis + history of instrumentation (TURP, bladder catheterization)</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong style="margin-left: 10px;">Pyelonephritis</strong>\r\n			<ul class="list-disc">\r\n				<li>\r\n				<p>Flank pain</p>\r\n				</li>\r\n				<li>\r\n				<p>High fever</p>\r\n				</li>\r\n				<li>\r\n				<p>Recent untreated UTI, STD</p>\r\n				</li>\r\n				<li>\r\n				<p>Polyuria</p>\r\n				</li>\r\n			</ul>\r\n			</td>\r\n			<td>\r\n			<p>Renal angle tenderness;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n', '', '', '', '', '', 8, 1, 0, '2017-12-14 06:47:34', '2017-12-14 06:47:34'),
(796, 4, 'Allergy/Irritants', 'allergyirritants-1', 604, '<div class="bot">\r\n<table>\r\n<tbody> 			<tr><td><p>H/O of smoking, exposure to dust, pollen, or exposure to chemical fumes, pollutants, animal dander, occupational exposure)</p></td><td><p>Nasal congestion</p></td></tr>\r\n					<tr><td><p>Sneezing</p></td><td><p>Inflammation of the pharynx</p></td></tr>\r\n					<tr><td><p>Runny nose &amp; congestion </p></td><td>&nbsp;</td></tr>\r\n					<tr><td><p>Sore throat</p></td><td>&nbsp;</td></tr>\r\n				\r\n\r\n\r\n</tbody>\r\n</table>\r\n</div>', '', '', '', '', '', 6, 1, 0, '2017-12-14 07:34:56', '2017-12-14 07:34:56'),
