INSERT INTO `testimonial` (`id`, `name`, `designation`, `location`, `description`, `category_id`, `type`, `youtube_link`, `image`, `created`, `modified`, `status`) VALUES
(57, 'Dr. Forrest', 'Doctor', 'Houston', '<p>I can personally attest that Dr June is the best of the best! Even though I did my training in the USA somehow could not get through it the first time. Dr.Mary June trained me in one day before the exam and helped me pass the 2nd time.</p>', 4, 'TEXT', '', '0b5e9cb9fb9fb16cef4b82bde6f7f989.png', '2017-12-13 12:49:37', '0000-00-00 00:00:00', 1),
(58, 'Dr. MGA', 'Doctor', 'Philippines', 'I have just purchased Step 6 of your Online video tutorial. Thus far, I really like the system and it is just easy and catered to skills necessary to pass CS. Thank you very much.', 4, 'TEXT', '', '2d17b5e20d41adcc30645caa1c70e720.png', '2017-12-13 12:52:05', '0000-00-00 00:00:00', 1),
(59, 'Dr.Rasleen', 'M4 Student', 'University of Illinois', 'Dr. June is the real deal. A dedicated teacher who will help you to excel on CS. With her straightforward, high-yield and reasonably priced review course, you will be extremely confident when you walk into your exam.', 4, 'TEXT', '', '6888b290b393a71958c3d89ce15da516.png', '2017-12-13 12:53:11', '0000-00-00 00:00:00', 1),
(60, 'Dr.Koni', 'Doctor', 'Greece', 'The way you organized me in just one session and what I ''ve learned in one day from you, I hadn''t learned in one and a half months preparing with other resources. I am 100% sure that if I would have spent more time with you, I would have 95 % chances', 4, 'TEXT', '', '2add32afa71607aaebd1c19b4b71b64f.png', '2017-12-13 12:53:57', '0000-00-00 00:00:00', 1),
(61, 'Dr. Amna', 'Doctor', 'Pakistan', 'This is the best course that i feel fortunate to have taken it after researching all others. It is not only the most reasonably priced it is also the most focused and offers one to one coaching instead of group lectures. Dr maryjune is a very dedicated, sincere and committed mentor who equips you with solid knowledge, smart strategies and time saving techniques that help you handle any case and finish in time too', 4, 'TEXT', '', '9452a0c243632cded50ca704b8e97577.png', '2017-12-13 12:54:58', '0000-00-00 00:00:00', 1),
(62, 'Dr. Fareeza', 'Doctor', 'USA', 'After exam day, I never felt that ''Oh ma''am didn''t tell me this or that!'' Your guidance was precious. I passed! Thanks to you ma''am!!', 4, 'TEXT', '', '701816b744f29dcdab6e27e5a71da710.png', '2017-12-13 12:59:36', '0000-00-00 00:00:00', 1),
(63, 'Dr. Wilber', 'Doctor', 'Peru', '7 Easy Steps 2CS - "Straight to the Point" - How should I do? What should I say? - all covered precisely!', 4, 'TEXT', '', 'fe1eeed90cd216a6f1b0fa6f299cf1e2.png', '2017-12-13 13:00:36', '0000-00-00 00:00:00', 1),
(64, 'Dr. Louis', 'Doctor', 'France', 'I am a French MD, PhD from France and failed the step 2 CS, although I had very good scores on step 1 and step 2 CK. Target USMLE is definitely a huge help for people like me and I recommend particularly this coach.', 4, 'TEXT', '', '58c53f94e6945a94e9a3888e06685f4f.png', '2017-12-13 13:01:23', '0000-00-00 00:00:00', 1),
(65, 'Dr.Jijo', 'Doctor', 'India', '"After first attempt, CS was like a nightmare without confidence but Dr. June made the whole process painless. The solutions she proposed to me positioned me to navigate through the whole CS exam effortlessly and confidently the 2nd time".', 4, 'TEXT', '', '3e1d301be61d35fdc67f30da0bbcecc4.png', '2017-12-13 13:02:06', '0000-00-00 00:00:00', 1),
(66, 'Dr. Gunjan', 'Doctor', 'Canada', 'The videos provided by Target USMLE were just what I needed to prepare for Step 2 CS. It is extremely hard to take time out of your rotations to attend classes for a board exam. The online videos were the perfect resource for step-by-step learning and preparation for the test day!', 4, 'TEXT', '', '11ce409ea8b23e5a1bef8d87029918aa.png', '2017-12-13 13:03:22', '0000-00-00 00:00:00', 1),
(67, 'Dr. Helen', 'Doctor', 'Russia', 'I passed my CS!!!! Thanks so much for your help. God bless you. My ICE was higher performance with a star. My SEP was in higher performances. My CIS was touching borderline to higher performance. Thanks again for your help.', 4, 'TEXT', '', '5b46a5caa88d836bfe0c38bde02b881d.png', '2017-12-13 13:04:09', '0000-00-00 00:00:00', 1),
(68, 'Dr. Lubna', 'Doctor', 'Jordan', 'Thxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx a lot Dr. Mary. I passed it this time! First time i felt the sp''s were controlling me but this time i felt i was in control of the whole encounter. Thanks for your training and confidence.', 4, 'TEXT', '', '34d62d8b98b03f61d9d3af6b3225e68a.png', '2017-12-13 13:04:51', '0000-00-00 00:00:00', 1),
(69, 'Dr. Maryam', 'Doctor', 'Oregon, USA', 'I passed, my exam. Thanks you for everything. I am speechless having passes it the 3rd attempt. I am now ECFMG certified. Thank God and you for your coaching me. My family and I will not forget your help in passing this exam. Thank you and God', 4, 'TEXT', '', '202e1831ba3923fb9c47a3e30a0792da.png', '2017-12-13 13:06:01', '0000-00-00 00:00:00', 1),
(70, 'Dr. Adrian', 'Doctor', 'Venezuela', 'This is Adrian, from Venezuela, I hope you remember me, I''m writing you to let you know that today I got the score for the CS exam and I passed, I want to thank you because without your help, tips and advises i would not have been able to make it!', 4, 'TEXT', '', '65d1c79d324344dace02f8663292e050.png', '2017-12-13 13:06:55', '0000-00-00 00:00:00', 1),
(71, 'Amazon review', 'Doctor', 'Amazon', '“Awesome awesome organization and presentation for easier learning and reining in information. Reading this book the first time gave a feeling of having passed the exam before taking it. This gets even better when used in tandem with the 7 easy steps video tutorial on their website @ targetusmle.com. Best wishes on your step 2 CS my colleagues!“', 5, 'TEXT', '', '254441e191160b8a31ffe72ac99eadb0.png', '2017-12-13 18:19:58', '0000-00-00 00:00:00', 1),
(72, 'Amazon review', 'Doctor', 'Amazon', '“Great book to an IMG preparing for the Step 2 CS exam. Gives you a systematic approach and understanding of the process. The book is very concise, has everything you need to know to pass the exam, especially a systematic approach that provides an algorithm to use in all possible scenarios. I strongly recommend it.“', 5, 'TEXT', '', '2885c4ec62c289a550efe9a246b9e7d3.png', '2017-12-13 18:21:11', '0000-00-00 00:00:00', 1),
(73, 'Amazon review', 'Doctor', 'Amazon', '“This book has everything you need for CS patient encounter. You can find sample cases in a lot of books and it actually is not a mystery but the question of how are you going to ask questions, how would you approach to the patient and note typing examples are priceless. As an IMG you''ll find your guideline here!”', 5, 'TEXT', '', '5ac98f5a6947baad77b5e64d45d2867e.png', '2017-12-13 18:25:44', '0000-00-00 00:00:00', 1),
(74, 'Dr. Yanovskiy', 'Doctor', 'Finland', '<p>I am very grateful for Dr. June for the course has evolved. Benefits are very flexible, timetable and course is structured with very useful and important questions for each system which is useful in our interview</p>', 4, 'VIDEO', 'https://www.youtube.com/embed/ZoqTZjc2ywA', '7116d2475ece7cf62508f124cc4eb35c.jpg', '2017-12-13 18:48:40', '0000-00-00 00:00:00', 1),
(75, 'Dr. Iman', 'MD', 'India', '<p>Hi I am a Iman from India, I use target usmle for step to CS. I took online course with Dr Mary June, is propabaly the best step to Cs Preparation course. I took it over Skype, from the comfort of my home and the schedule is flexible at your ease. She teaches one on one which is very important.</p>', 4, 'VIDEO', 'https://www.youtube.com/embed/xZpIU5hcD10', 'bb8f5c2757eb6c024ee73e8c0fa54ced.jpg', '2017-12-13 18:57:22', '0000-00-00 00:00:00', 1),
(76, 'Dr. Nicholas Ofori', 'Doctor', 'Ghana', '<p>Hello, My Name us Nicolas Ofori, I am a medical doctor, I recently took my exams in united states Step 2 Cs by a month ago. I am doing this video to share with the folks out there who are preparing for this exam and how I prepared for this exam. I took 3 months in preparing for this CS</p>', 4, 'VIDEO', 'http://https://www.youtube.com/embed/XLvrRbijLPU', '4c9a65d443bca9e318c247a68f40137c.jpg', '2017-12-13 19:04:30', '0000-00-00 00:00:00', 1),
(77, 'Dr. Giresha', 'Doctor ', 'USA', '<p>Dr. June is great coach she teaches you how to organize all your thoughts and when I come to a diagnosis, her lectures and power point presentations are amazing. I would recommend target usmle to anyone who is considering to take the exam.</p>', 4, 'VIDEO', 'https://www.youtube.com/embed/k8FBxA6g6wI', '3bbe869067fc8e8b675da5fad35c2e3f.jpg', '2017-12-13 19:14:10', '0000-00-00 00:00:00', 1),
(78, 'Dr. Jose Trujillo', '', 'USA', '<p>I took a course the name is Target USMLE, you can google it by yourself to check it out. "Targetusmle.com" and this course was very complete and very useful to me to pass the exams. It teaches you about how to interview the patient to gather the information you need.</p>', 4, 'VIDEO', 'https://www.youtube.com/embed/CvU2Iy6m3zc', 'a6fc895cd6d5540123810e4dcaa1342f.jpg', '2017-12-13 19:18:10', '0000-00-00 00:00:00', 1),
(79, 'Dr. Swathi', '', 'India', '<p>I took an online course with Dr. Mary June, is probably the best step to Cs Preparation course. I took it over Skype, from the comfort of my home and the schedule is flexible at your ease. She teaches one on one which is very important.</p>', 4, 'VIDEO', 'https://www.youtube.com/embed/-1ONnOBwj7I', 'b9dc541df02894e84ce7bc2258786742.png', '2017-12-13 19:54:45', '0000-00-00 00:00:00', 1),
(80, 'Dr. Antonopolo', '', 'Greece', '<p>I took the online exam just two days before my exam. I came to know how I should organize my exam, in just two hours. Target usmle it fully organized and I''m, pretty sure Dr. June coaching will help you to pass step 2 cs.</p>', 4, 'VIDEO', 'https://www.youtube.com/embed/LP0NJ5R_X3k', '20de84e41da060ae6d0f676c428cd1f2.jpg', '2017-12-13 20:02:12', '0000-00-00 00:00:00', 1),
(84, 'Dr. Swathi', '', 'India', 'I took an online course with Dr. Mary June, is probably the best step to Cs Preparation course. I took it over Skype, from the comfort of my home and the schedule is flexible at your ease. She teaches one on one which is very important.', 5, 'VIDEO', 'https://www.youtube.com/embed/-1ONnOBwj7I', '66deaa293a9f94d3ed2ce92b51924a6b.png', '2017-12-20 12:24:19', '0000-00-00 00:00:00', 1),
(85, 'Dr. David Elbaze ', '', 'France', 'The coaching was very useful. She helped me for the english coaching. It was good Sync for me. I really appreciate for all that she did for me.', 5, 'VIDEO', 'https://www.youtube.com/embed/4wReyNqM5cI', '', '2017-12-20 12:29:04', '0000-00-00 00:00:00', 1),
(86, 'Dr. Himangini', '', 'India', 'I attended online classes of target usmle. Her kindle edition book is awesome, she used to guide you all the part of the exam and I strongly recommend to do it with her.', 5, 'VIDEO', 'https://www.youtube.com/embed/Jnsi9UnMIFo', '', '2017-12-20 12:30:16', '0000-00-00 00:00:00', 1),
(87, 'sdsfd', 'dfdfdf', 'dfdfd', 'sdfsfdfdf', 4, 'VIDEO', 'https://www.youtube.com/embed/Jnsi9UnMIFo', 'a25815e12f3831d5885399f3bb68f15b.jpg', '2018-05-11 10:10:00', '0000-00-00 00:00:00', 1);
